    "11200202": {
        i18n_id: "11200202",
        i18n_cn: "从小没爹没娘，受过叔叔荀彧举荐。曹操迎天子入许都后，他便成为曹操的军师。他行事周密低调，计谋百出，一直跟随曹操四处征战。直到生命的尽头，他仍走在伐吴的路上。他外愚内智，外怯内勇，外弱内强，曾设奇策十二计，辅佐曹操统一北方。他受人尊敬，生病时，曹丕曾下拜。他就是这样一个人，曹操每每提起，便会流泪。"
    },
    "11202202": {
        i18n_id: "11202202",
        i18n_cn: "其父鲍信为曹操好友，与曹操共同抵御黄巾军时，为掩护其突围而战死疆场。后曹操追录其功，鲍勋始入职场，而后素以清白高洁知名于世。曹丕继位前，他曾因秉公执法得罪曹丕；继位后，又因屡次谏诤触怒曹丕，最终被借故处死。"
    },
    "16403102": {
        i18n_id: "16403102",
        i18n_cn: "我叫小小志，最初是张宝下面的保安，因为他没给我涨工资，我就跳槽去了许褚那儿。因为我长得帅，又会打手枪，许褚让我做了青州枪兵。想当年我也和陶谦一起参加过选秀，但海选就被淘汰了。"
    },
    "12100402": {
        i18n_id: "12100402",
        i18n_cn: "碎嘴的老好人。大智若愚，说他不懂天下事吧，只有他，相信深山有宝，斥重开采出埋藏在火焰山底的“天火锻”。说他胸怀天下吧，他又自称开采神器，只为了锻造他的草鞋铺，将来好开全国连锁店。表面看他只是一个草鞋铺老板，天下人却称他为刘皇叔；他似乎天生贫弱，谁都打不过，但他同时又是关羽、张飞两元猛将的大哥。三国最矛盾也最具个性的主公，比起反贼，他自己本身也充满了谜团。"
    },
    "12202302": {
        i18n_id: "12202302",
        i18n_cn: "关羽的第三子，刘关张桃园结义，关羽妻胡氏怀着关索回到娘家，生下关索。他7岁走失，为索员外拾得，9岁被花岳老先生收为弟子，遂取名为“花关索”。年纪轻轻的他，十八般武艺双全。后来他与母亲同去荆州认父，途中娶了鲍三娘和王桃、王悦姐妹为妻。投蜀后，在曹魏十万大军伐蜀时战死，其妻鲍三娘也壮烈殉国。"
    },
    "12202002": {
        i18n_id: "12202002",
        i18n_cn: "他自幼便是孤儿，后被刘备收为义子。他个性刚猛，武力过人，曾随张飞、赵云扫荡西川，攻无不克。后又统领孟达攻取上庸，深为刘备信任。但后来关羽被困麦城，他误听孟达离间之言，不发兵救援，终致关羽被杀。随后孟达畏罪降魏，与徐晃共袭刘封，刘封拒降，却遭部下叛变，终败归成都。诸葛亮担心刘备死后难以制服驾驭刘封，便建议刘备将其赐死，他最终自裁。"
    },
    "16400102": {
        i18n_id: "16400102",
        i18n_cn: "我叫文长，因为糜竺的老婆看上了我，让我当了巴蜀刀兵，想当年我还帮助过刘备。"
    },
    "13100802": {
        i18n_id: "13100802",
        i18n_cn: "从小是大乔的跟班，两姐妹常打扮成寻常女子上山狩猎，某次打猎时，误打误撞遇见孙策携周瑜一切打猎，四人相对，各自有了中意的人。小乔爱慕周瑜英俊风流、文武双全，成为周瑜的妻子，两人才子佳人，珠联璧合一起幸福的生活，直至周瑜去世。小乔为让夫君起死回生受反贼的蛊惑，犯下大错。"
    },
    "13201802": {
        i18n_id: "13201802",
        i18n_cn: "侍女队长原名淘淘，想当年孙坚能文能武，俘获无数青春少女的芳心，淘淘也是仰慕者之一，但是她自知身份悬殊与孙坚不可能有结果，于是苦练武艺，终于被选为吴夫人的侍卫队长，虽不能与心爱之人有结果，但是能日日见到他，她已经满足了。"
    },
    "16404202": {
        i18n_id: "16404202",
        i18n_cn: "大家都叫我嫌秀，可能因为我平时什么事都抢着做的原因吧。濡须会战吕蒙，吕都督还救过我，为了感谢他，我一定会好好干的，以后争取多多杀敌。"
    },
    "14100502": {
        i18n_id: "14100502",
        i18n_cn: "左手有剑，右手有光，觉得自己是超级厉害的勇士，面对敌军万马奔腾，只说何人堪与我战，我是黄巾军的首领，太平道等着我创立。一直以为世界上有一股神秘力量在祝福他，后来发现，神秘力量并不存在，有的只是隐藏在层层迷雾中的反贼，为了不受其利用，甘愿自我了断。"
    },
    "14201802": {
        i18n_id: "14201802",
        i18n_cn: "他们是天公将军张角座下的黄巾左使与黄巾右使，合称为黄巾雷使。当年道人于吉传授张角《太平清领书》时，给了他两张符咒帮他抵挡灾祸，后来这两张符咒化身为黄巾雷使，一直伴随在张角左右。"
    },
    "14301502": {
        i18n_id: "14301502",
        i18n_cn: "黄巾起义前，黄巾军于荆州、扬州的大帅，奉黄巾军首领张角之命筹划黄巾起义准备工作，遭张角弟子唐周的告密，在公元184年1月被捕，车裂于洛阳，迫使张角提前于2月起兵发动叛乱。"
    },
    "16405202": {
        i18n_id: "16405202",
        i18n_cn: "别看我们黄金锤兵拿个锤子很威风的样子，我们也不过是一群随时可以被人抛弃的杂兵而已，我要好好学习，天天向上，我要学好功夫，让所有人都知道我叫李廉洁。"
    },
    "16406002": {
        i18n_id: "16406002",
        i18n_cn: "知道什么是重骑兵么？我们重骑兵就是战场上无敌的存在，由于在战场上杀敌勇猛，他们平时都开玩笑叫我马给力。我还跟着我们家张郃将军剿过黄巾贼呢。"
    },
    "12101302": {
        i18n_id: "12101302",
        i18n_cn: "张飞之女，和刘禅两小无猜，青梅竹马的长大。因长在军中，父亲又是一个粗人，十分厌恶军人生硬、粗暴的性格特征，相反觉得刘禅温柔可爱，起了喜爱之心。在别人都看不起刘禅的时候，只有她站在刘禅的身边，认同刘禅的理念，相信他的为人，并对他不离不弃的照顾，防止别人欺负他，最后有情人终成眷属，做了刘禅的王妃。"
    },
    "13101302": {
        i18n_id: "13101302",
        i18n_cn: "脾气暴躁，三国时期的黑社会头领，亲于杀戮，经常违法乱纪，惹怒孙权及其手下将领。但武艺高强，拥兵自重，使孙权重视他的长处，不得不厚待他。这使他骄横跋扈，以吴王自居。他及重义气，当反贼许以重利，利用他灭绝东吴时，被他一口回绝，甚至兴起要与反贼大战，只可惜不是反贼的对手，死于荒野。"
    },
    "19100502": {
        i18n_id: "19100502",
        i18n_cn: "爱吃肉、爱睡觉、不爱运动，听说他姓肥……我只能告诉你这么多……（宠物们主要作为战技升级材料，可在战技升级时吃掉，好吃你就多吃点。）"
    },
