    "21100502": {
        i18n_id: "21100502",
        i18n_cn: "得名于宋玉《大言赋》中名句“长剑耿耿倚天外”。因其锋锐无比，遂成宝剑的代称，甚至连李白都对其仰慕不已。它与青釭剑被并称为“绝世双剑”，是曹操随身所佩名剑。曹操曾因吕伯奢一家对他太好而满怀疑心，在当晚挥此剑杀尽其家八口后离开。陈宫责其不义时，他便说了这千古名句：“宁教我负天下人，休教天下人负我”。"
    },
    "21200302": {
        i18n_id: "21200302",
        i18n_cn: "曾经使用此武器的三国袁术手下第一将领纪灵，与关公大战三百回合未分胜负，此刀六十五斤重。刀尖分为三支，“山”字形两面开刃，锋利无比。"
    },
    "21400102": {
        i18n_id: "21400102",
        i18n_cn: "说个锤子！"
    },
    "22100802": {
        i18n_id: "22100802",
        i18n_cn: "朱雀为南方火神，四大神兽之一，形似凤凰，却非凤凰。凤凰是百鸟之王，而朱雀却是更加稀有尊贵的天之灵兽，其力量也更强。据说有人曾用新生的朱雀羽毛制成一顶羽冠，可使佩戴之人拥有朱雀之神力，此冠即为后世闻名的朱雀冠。"
    },
    "22300102": {
        i18n_id: "22300102",
        i18n_cn: "精铁打造的盾牌，低调实用。"
    },
    "23100302": {
        i18n_id: "23100302",
        i18n_cn: "三国名马之一，属于河套马种，耐力惊人，速度飞快，奔跑起来如剧猛的风卷起帆船一般，故名。它是曹魏名将曹真之马，曹真曾用此马与司马懿打赌。"
    },
    "23200302": {
        i18n_id: "23200302",
        i18n_cn: "产自异域波斯国的名马，又叫‘追风赤骥’。看名字就知道它跑起来有多快。"
    },
    "23400102": {
        i18n_id: "23400102",
        i18n_cn: "经常帮自己洗头的马，所以此马拥有一头乌黑亮丽的长发，故此得名。"
    },
    "24100602": {
        i18n_id: "24100602",
        i18n_cn: "语出《礼记·曲礼上》：“效马效羊者右牵之”。后世因以“顺手牵羊”比喻顺便行事，毫不费力。 顺手牵羊也是《三十六计》中的第十二计。三国时，司马懿千里急行军，在孟达工事未固时，抓住机会，斩了孟达，平息了叛乱。"
    },
    "24200502": {
        i18n_id: "24200502",
        i18n_cn: "话说关羽当年率兵攻打樊城。曹操派了于禁、庞德救援。庞德带上棺材，发誓要与关羽决一死战。看的于禁非常嫉妒，于是把军队都转移到了北罾口川；关羽乘着襄江水大涨的时候放水淹了于禁等七路大军军，生擒于禁、庞德。此计便是水淹七军。"
    },
    "24400302": {
        i18n_id: "24400302",
        i18n_cn: "就是招募士兵为自己战斗，刘备就是募兵的高手。建安元年，吕布偷袭了下邳，俘虏了刘备的妻子。刘备想回去救，但中途军队就溃散了，只招收了一点人，而且又被袁术打败，只好和吕布求和。不久之后，他竟然招募了10000多人，又和吕布干了起来，可见刘备的募兵能力。"
    },
