    "35100502": {
        i18n_id: "35100502",
        i18n_cn: "【天妒】能让郭嘉智力大增的秘诀，属被动技能，主智。装备后，可增加自身智力。"
    },
    "31200802": {
        i18n_id: "31200802",
        i18n_cn: "【毅重】获得于禁超强护体神功，战场可减伤，属卖血技能，主防。受伤前一般概率触发，可减少自身受到的伤害。"
    },
    "35101402": {
        i18n_id: "35101402",
        i18n_cn: "【集智】黄月英天资聪慧的秘诀，属被动技能，主智。装备后，可增加自身的智力。"
    },
    "32101502": {
        i18n_id: "32101502",
        i18n_cn: "【放权】阿斗能让攻最强的友军多出一份力，属控场技能，主智。行动前易触发，可回复自身一定血量，同时让己方1名武将额外行动一次。"
    },
    "32201802": {
        i18n_id: "32201802",
        i18n_cn: "【勇决】糜夫人死亡时将对某个敌人造成伤害，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害。"
    },
    "33101102": {
        i18n_id: "33101102",
        i18n_cn: "【追忆】步练师的回忆，死亡时可让血最少的己方战友回血并减伤，属卖血技能，主防。阵亡时，可回复场上血最少己方武将一定血量，同时减少其下一次受到的伤害。"
    },
    "33202002": {
        i18n_id: "33202002",
        i18n_cn: "【直言】能对敌人造成剧烈伤害的能力，属攻击技能，主智。行动时一般概率触发，可对敌方单体造成智力伤害。"
    },
    "35103102": {
        i18n_id: "35103102",
        i18n_cn: "【完杀】贾诩能让敌人体无完肤的攻击力，属被动技能，主攻。装备后，可增加自身攻击力。"
    },
    "34202102": {
        i18n_id: "34202102",
        i18n_cn: "【死谏】田丰以死明谏之志，能与最弱的敌军同归于尽，属卖血技能，主防。阵亡后，可对场上血最少敌军造成防御伤害。"
    },
    "30310802": {
        i18n_id: "30310802",
        i18n_cn: "【穿刺】以武力取胜的方法之七，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "36100102": {
        i18n_id: "36100102",
        i18n_cn: "【经验神书】能使任意技能获得大量提升的神书。在技能升级界面吃掉后，可获得大量技能经验。"
    },
    "33101002": {
        i18n_id: "33101002",
        i18n_cn: "【缔盟】鲁肃合纵连横、缔结强大联盟来保护己方成员的大智慧，属攻击技能，主智。行动时易触发，对对方总属性最高的武将造成智力伤害，并增加其下一次受到的伤害，同时减少该敌方武将对位的己方武将下一次受到的伤害。"
    },
    "32100802": {
        i18n_id: "32100802",
        i18n_cn: "【龙胆】子龙伤敌护己的秘诀，属控场技能，主攻和防。行动前易触发，可增加自身下一次造成的伤害，同时减少自身下一次受到的伤害。"
    },
    "33102502": {
        i18n_id: "33102502",
        i18n_cn: "【国色】大乔拥有让人无法行动的美貌，属控场技能，主智。行动前一般概率触发，可对敌方单体造成智力伤害，并且让其无法行动2回合。"
    },
    "38100302": {
        i18n_id: "38100302",
        i18n_cn: "【魔铁骑】魔·马超受伤后可魔性大发，杀敌一片，属卖血技能，主防。受伤后易触发，可对敌方全体造成防御力伤害。"
    },
    "37100502": {
        i18n_id: "37100502",
        i18n_cn: "【圣弓】黄忠百发百中直取敌方要害的弓术，属攻击技能，主攻。行动时易触发，可对场上防最低敌军造成攻击伤害。"
    },
