    surrunderdesc_2: {
        i18n_id: "surrunderdesc_2",
        i18n_cn: "(*/ω＼*) 从来没想到，我还能再一次找到爱情！"
    },
    surrunderdesc_12: {
        i18n_id: "surrunderdesc_12",
        i18n_cn: "曹丕是个爱记仇的小心眼，我以后还是跟你混吧？！"
    },
    surrunderdesc_22: {
        i18n_id: "surrunderdesc_22",
        i18n_cn: "听闻主公兵源不足，我率众前来投靠，希望能为主公效力！"
    },
    surrunderdesc_32: {
        i18n_id: "surrunderdesc_32",
        i18n_cn: "主公，郭嘉哥哥说你喜欢身轻音柔易推倒的人，你看我行么？"
    },
    surrunderdesc_42: {
        i18n_id: "surrunderdesc_42",
        i18n_cn: "主公得我一人，则可以一敌万！"
    },
    surrunderdesc_52: {
        i18n_id: "surrunderdesc_52",
        i18n_cn: "我常听人说您重情重义，喜欢惩恶扬善，但能助我为父报仇，夺回青龙偃月刀，我愿誓死臣服！"
    },
    surrunderdesc_62: {
        i18n_id: "surrunderdesc_62",
        i18n_cn: "好一个不打不相识！从今以后，你的事就是我的事！"
    },
    surrunderdesc_72: {
        i18n_id: "surrunderdesc_72",
        i18n_cn: "还记得19年前巴蜀湖畔的邓雨荷么？没错，那是我娘，娘让我来寻你了！爹！！！我终于找到你了！"
    },
    surrunderdesc_82: {
        i18n_id: "surrunderdesc_82",
        i18n_cn: "被你那呆样儿萌化的我，终于明白了什么是命中注定… …"
    },
    surrunderdesc_92: {
        i18n_id: "surrunderdesc_92",
        i18n_cn: "我最美的年华，只为遇到你… … "
    },
    surrunderdesc_102: {
        i18n_id: "surrunderdesc_102",
        i18n_cn: "听闻主公进兵至江东，我愿举兵归附！"
    },
    surrunderdesc_112: {
        i18n_id: "surrunderdesc_112",
        i18n_cn: "听说主公您喜欢玩火，但做人不能只会玩火啊，还要会灭火啊，我是一名灭火专家，我在有备无患哪！"
    },
    surrunderdesc_122: {
        i18n_id: "surrunderdesc_122",
        i18n_cn: "想借助我的仙力么？！如果你能答应我，从此一心普救世人，我就臣服于你！点击确定，我就当你答应了！"
    },
    surrunderdesc_132: {
        i18n_id: "surrunderdesc_132",
        i18n_cn: "吾可力负五百斤，日行八百里，曹操都想占我为己用！但我除了主公您，谁都看不上，肿么破？！"
    },
    surrunderdesc_142: {
        i18n_id: "surrunderdesc_142",
        i18n_cn: "主公，听说最近有人对你图谋不轨，让我来帮你在暗中监视他们吧！"
    },
    surrunderdesc_152: {
        i18n_id: "surrunderdesc_152",
        i18n_cn: "听闻主公您年纪轻轻，就已经征战无数，大有作为，在下十分敬佩，不知以后可否与您一同杀敌？！"
    },
    surrunderdesc_162: {
        i18n_id: "surrunderdesc_162",
        i18n_cn: "我爹光环所在的地方，总能看到我的影子，多想自己也去闯一闯，主公你能成全我吗？"
    },
    surrunderdesc_172: {
        i18n_id: "surrunderdesc_172",
        i18n_cn: "主公，我其实不像他们说的那样成事不足败事有余，你要相信我啊主公，我是永远忠诚于你的！"
    },
    surrunderdesc_182: {
        i18n_id: "surrunderdesc_182",
        i18n_cn: "主公，有我守护您，看谁还敢来挑衅！"
    },
    surrunderdesc_192: {
        i18n_id: "surrunderdesc_192",
        i18n_cn: "主公，听说你认识我钟意的那只母猴儿？快帮我打听打听她是哪村儿滴……我害羞……"
    },
