    climbLadder_Instruction: {
        i18n_id: "climbLadder_Instruction",
        i18n_cn: "1、主公15-19级可入铜榜；主公20-24级可入银榜；主公25-29级可入金榜；主公30级以上可入神榜；\n2、铜、金、银、神各榜单显示前一日闯关数最多的前20名玩家，各榜单每日00:00点刷新； \n3、进入排行榜的玩家，可获得元宝奖励，奖励数量依排名高低递减：铜榜最高奖励200元宝；银榜最高奖励300元宝；金榜最高奖励400元宝；神榜最高奖励500元宝；\n4、胜利闯关必获得银两和将魂； \n5、闯关前有机会遇到携带宝物的敌方武将，将其击杀便可获得宝物； \n6、每闯3关，会触发1次随机属性加成，每次有3种百分比的属性加成可供选择，玩家3选1后，将会消耗一定数量的将魂，并在后面的闯关过程中获得对应的属性加成； \n7、玩家每轮斩将人数到达一定数量时，将会获得一定数量的宝箱、钥匙、元宝等奖励；斩将坚持的轮数越多，奖励的数量越多。"
    },
