    "21100602": {
        i18n_id: "21100602",
        i18n_cn: "简称双股剑，又名鸳鸯剑，是刘备的兵器。左手雌剑轻而短，灵动锋利，有吹毛断发之功效；右手雄剑重而长，刚硬无比，有刺穿钢制铠甲之功效。两剑均经特殊工艺锻造七七四十九天，利可断金。"
    },
    "21200402": {
        i18n_id: "21200402",
        i18n_cn: "吴国大帝所拥有的六把宝剑，分别为白虹，紫电，辟邪，流星，青冥，百里。获得此等装备可以在江东横着走。"
    },
    "21400302": {
        i18n_id: "21400302",
        i18n_cn: "刀乃百兵之霸，此刀虽然看似普通，但也是杀敌利器，值得拥有。"
    },
    "22100902": {
        i18n_id: "22100902",
        i18n_cn: "麒麟为龙与牛所生之子，头生独角不是鹿，身上长鳞不像龙。后鲁哀公打猎时将其射死，因不知为何物，遂请孔子前来辨认，孔子见是仁兽麒麟，便嚎啕大哭。后来有人将其长麟制于战袍之上，竟在战场之中刀枪不入。"
    },
    "22300202": {
        i18n_id: "22300202",
        i18n_cn: "99纯金编织的衣服，古代高富帅的象征之一。"
    },
    "23100402": {
        i18n_id: "23100402",
        i18n_cn: "“人中吕布，马中赤兔”，它一直是宝马的代言。据说此马为汗血宝马，红色，可日行千里，还能夜走八百，但性情暴烈，不易驯服。它最早为董卓的坐骑，后来被董大胖儿用来收买吕布；吕布死后，它又被曹操赏赐给关羽；关羽被杀后，赤兔马不再追随新主马忠，最后因思念关羽，绝食而亡。"
    },
    "23200402": {
        i18n_id: "23200402",
        i18n_cn: "吴国之主孙权的马，可以与的卢媲美，在逍遥津之战一跳飞过小师桥救了孙权一命。"
    },
    "23400202": {
        i18n_id: "23400202",
        i18n_cn: "据说是黑鬃的双胞胎的弟弟，为了与他哥哥区分，自己去把头发染成了白色，所以叫白鬃。"
    },
    "24100702": {
        i18n_id: "24100702",
        i18n_cn: "出自苏轼《八月十五看潮五绝》的第五首诗：“安得夫差水犀手，三千强弩射潮低”。其典故源于五代时，吴越王曾命令他的部队向钱塘大潮万箭齐发，妄想把钱塘大潮压下去。三国时，诸葛亮草船借箭，曹操中计，使用万箭齐发，让诸葛亮顺利借到十万之箭。"
    },
    "24200602": {
        i18n_id: "24200602",
        i18n_cn: "这是三国后期，西晋灭东吴的故事。当年西晋益州刺史王濬奉命建造战船，打算征伐东吴。建平的太守吾彦，为阻止西晋敌军，制造铁锁链，在险要之处放下横断长江。但因其守军不足，敌军最终还是成功通过。该计谋是在吾彦无可奈何的情况下实施的，折射出一种“奇谋报国，可怜无用”的情感。"
    },
    "21101302": {
        i18n_id: "21101302",
        i18n_cn: "当年黄月英的父亲怕诸葛亮有眼不识荆山玉，才故意说女儿丑，但月英其实不仅才高聪慧，而且笔下滔滔，武艺超群。师出名门的她，在学成下山之时，获得一把师父赠予的北斗七星扇，上书“明、亮”二字。二字中还密密麻麻的藏着攻城略地、治国安邦之计，并嘱咐她，姓名中有明、亮二字者，即为你如意郎君。后来月英结婚时，便将此扇作为礼物赠予诸葛亮，诸葛亮自此对其爱如掌上明珠，形影不离。"
    },
