    surrunderdesc_43: {
        i18n_id: "surrunderdesc_43",
        i18n_cn: "我就是传说中60岁的人，30岁的心脏！要不是我当年手下留情，可一箭射中关公额头！主公，请尽情的称赞我吧！"
    },
    surrunderdesc_53: {
        i18n_id: "surrunderdesc_53",
        i18n_cn: "吾因世乱流落江湖，劫掠为生，得遇主公后，愿从此改邪归正，重新做人，主公给我一次机会吧？"
    },
    surrunderdesc_63: {
        i18n_id: "surrunderdesc_63",
        i18n_cn: "主公，我看重您的为人，以后有需要我帮助的地方尽管开口，要钱有钱，要人有人！"
    },
    surrunderdesc_73: {
        i18n_id: "surrunderdesc_73",
        i18n_cn: "多亏了关平我才有机会当了兵，认识了主公您，难以忘记你那英俊潇洒的样子，好恨自己不是GAY… …"
    },
    surrunderdesc_83: {
        i18n_id: "surrunderdesc_83",
        i18n_cn: "若为主公故，周瑜皆可抛！"
    },
    surrunderdesc_93: {
        i18n_id: "surrunderdesc_93",
        i18n_cn: "听说主公您最近在招募善于骑射的人？太巧了，那人就是我吖！"
    },
    surrunderdesc_103: {
        i18n_id: "surrunderdesc_103",
        i18n_cn: "世上有这么多有才的人，主公您为何偏偏征召我？难道是我长得太帅了吗？！"
    },
    surrunderdesc_113: {
        i18n_id: "surrunderdesc_113",
        i18n_cn: "既然你已经战胜了我，我甘愿臣服于你，认你做干爹。干爹，请受孩儿一拜！"
    },
    surrunderdesc_123: {
        i18n_id: "surrunderdesc_123",
        i18n_cn: "有一天，我的家人突然无声无息的消失了，我好怕，我的世界只剩你了… …  "
    },
    surrunderdesc_133: {
        i18n_id: "surrunderdesc_133",
        i18n_cn: "再也不想过落草为寇的日子了，主公，请收留我吧！"
    },
    surrunderdesc_143: {
        i18n_id: "surrunderdesc_143",
        i18n_cn: "虽然我长得帅，但我不是花瓶，为了证明，我想改头换面，主公，带我上战场吧！让我用帅气，迷倒那些GAY们。"
    },
    surrunderdesc_153: {
        i18n_id: "surrunderdesc_153",
        i18n_cn: "我曾亲眼目睹华雄被斩全过程，关羽真的很厉害，华雄还没有反应过来，可是那天突然听说主公你竟然打败了关羽，真让我大吃一惊！好想做你的小弟啊！"
    },
    surrunderdesc_163: {
        i18n_id: "surrunderdesc_163",
        i18n_cn: "你前世欠我的诺言，今生可否一并还我？"
    },
    surrunderdesc_173: {
        i18n_id: "surrunderdesc_173",
        i18n_cn: "主公，有我在，江南可平矣！"
    },
    surrunderdesc_183: {
        i18n_id: "surrunderdesc_183",
        i18n_cn: "我的武艺虽不在关羽之下，却终败于你，今日甘愿臣服！"
    },
    surrunderdesc_193: {
        i18n_id: "surrunderdesc_193",
        i18n_cn: "主公，听说您博学多闻，爱兵如子，我来投奔您了！"
    },
