    "23101101": {
        i18n_id: "23101101",
        i18n_cn: "神兽"
    },
    "21100702": {
        i18n_id: "21100702",
        i18n_cn: "它是江东猛虎孙坚在汜水关时用的兵器。它没有刀托，只有刀柄跟刀身，两面都开了刃口，刀身带有弧度。其刀身因多次铸造而有了松纹，所以又叫松纹古锭刀。然该刀在坊间还另有大名，人称菊花刀。这把残忍好杀的宝刀，可使所有受到它伤害的人一生活在阴影中，仿佛它伤害的不仅仅是人的肉体，而且人的灵魂。"
    },
    "21200502": {
        i18n_id: "21200502",
        i18n_cn: "七星刀，当年曹操刺杀董卓用的凶器，结果刺杀未遂变成了献给董卓的礼器，后董卓把此刀送给了吕布，之后下落不明，此刀也算是一生颠沛流离，可叹可叹啊！"
    },
    "21400502": {
        i18n_id: "21400502",
        i18n_cn: "没事扇一扇，好运自然来！"
    },
    "22101002": {
        i18n_id: "22101002",
        i18n_cn: "七星甲除了可以防御之外，更能与主人合二为一，传说遇到强敌时，它会自动发出赤橙黄绿青蓝紫七道光束，罩住主人的周身，七星甲不灭，主人不死。"
    },
    "22300302": {
        i18n_id: "22300302",
        i18n_cn: "只有将军才能穿戴的披风，穿上之后威风凛凛，很有气势"
    },
    "23100502": {
        i18n_id: "23100502",
        i18n_cn: "它浑身雪白，能日行千里，产于西域，为极品马中的极品。它出生后只有脖子周围长毛，像雄师一般，性格暴烈；但长大后，它在夜晚会发出银色白光，因此会被赶出马群，变得温顺，这便是它名字的来源。它是赵云的坐骑，长坂坡上，曾令赵云七进七出而不败，落入陷阱又一跃而出的，就是它。"
    },
    "23200502": {
        i18n_id: "23200502",
        i18n_cn: "老当益壮、弥尔益坚的黄忠的坐骑，此马与主人一样性格犹如燎原烈火，所以叫燎原火。"
    },
    "23400302": {
        i18n_id: "23400302",
        i18n_cn: "马的堂兄弟，长的比较像马，长的很结实，耐粗放，不易生病。"
    },
    "24100802": {
        i18n_id: "24100802",
        i18n_cn: "官渡之战后期，曹操军中粮草紧缺，恰逢袁绍谋士许攸与营中将士不和，前来投奔。于是曹操接受了许攸的献计，火烧袁绍军粮，使其兵粮寸断，不战自败。"
    },
    "24200702": {
        i18n_id: "24200702",
        i18n_cn: "董奉，字君异，三国三大名医之一。话说当年他经过交州，刺史士燮罹中毒性休克，看着已经死亡三天了，经过董奉救治，起死回生啊。“杏林”，医界的这个别称。也是出自董奉。"
    },
    "21101402": {
        i18n_id: "21101402",
        i18n_cn: "上古时期，三皇之首伏羲为保护天界，亲制镇魂琴，用于吸收镇压极恶之人的天、地、命三魂。据说此琴有一种神秘力量，可支配万物之心，因而才能镇压极恶之魂。弹奏时，此琴会发出温柔的白光，其琴音可使人驱除邪念，宁静祥和。"
    },
