    "31101502": {
        i18n_id: "31101502",
        i18n_cn: "【绝情】春哥能让敌人无法发动技能的绝技，属控场技能，主攻。行动前易触发，可对敌方单体造成攻击伤害，同时将其封印2回合。"
    },
    "31201602": {
        i18n_id: "31201602",
        i18n_cn: "【筹书】戏志才死后能将血最少的敌人带走，属卖血技能，主防。阵亡时，可对场上血最少敌军造成防御伤害。"
    },
    "32100702": {
        i18n_id: "32100702",
        i18n_cn: "【咆哮】张飞喝退敌军之技，能连续多次伤敌，属攻击技能，主攻。行动时易触发，可对敌方单体造成连续多次攻击伤害。"
    },
    "32101802": {
        i18n_id: "32101802",
        i18n_cn: "【血祭】关羽留给女儿的群殴秘术，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害。"
    },
    "32202002": {
        i18n_id: "32202002",
        i18n_cn: "【陷嗣】能让防最高的敌人受到重大打击，属控场技能，主攻。行动前易触发，可增加场上防最高敌军下一次受到的伤害。"
    },
    "33101502": {
        i18n_id: "33101502",
        i18n_cn: "【不屈】周泰的性格，战场中可屹立不倒，属卖血技能，主防。血量为0时必定触发，可承受额外伤害。"
    },
    "33202202": {
        i18n_id: "33202202",
        i18n_cn: "【独进】能够反击敌人的力量，属卖血技能，主防。受伤后一般概率触发，可对敌方单体造成防御伤害。"
    },
    "34101202": {
        i18n_id: "34101202",
        i18n_cn: "【乱击】大嘴袁绍可对敌人全军造成干扰的秘术，属攻击技能，主智。行动时易触发，可对敌方场上全体造成智力伤害。"
    },
    "34202202": {
        i18n_id: "34202202",
        i18n_cn: "【狂斧】潘凤能使敌人伤害减弱的伎俩，属控场技能，主攻。行动前一般概率触发，可对敌方单体造成攻击伤害，同时减少其下一次造成的伤害。"
    },
    "30311002": {
        i18n_id: "30311002",
        i18n_cn: "【杀戮】以武力取胜的方法之九，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "36300102": {
        i18n_id: "36300102",
        i18n_cn: "【经验银书】能使任意技能获得少量提升的银书。在技能升级界面吃掉后，可获得少量技能经验。"
    },
    "33101402": {
        i18n_id: "33101402",
        i18n_cn: "【苦肉】黄盖的苦肉之计，越受伤越强悍，属控场技能，主攻。行动前易触发，有几率连续多次消耗自身血量，用以增加自身攻击力。"
    },
    "35103402": {
        i18n_id: "35103402",
        i18n_cn: "【武神】神·关羽无人能敌的秘诀，属被动技能，主攻和防。装备后，可同时增加自身攻击力和防御力。"
    },
