    itemdesc311004: {
        i18n_id: "itemdesc311004",
        i18n_cn: "【洛神】甄姬可秒杀敌人的绝密武功，属控场技能，主智。行动前易触发，有几率连续多次增加自身造成智力伤害的能力。"
    },
    itemdesc312008: {
        i18n_id: "itemdesc312008",
        i18n_cn: "【毅重】获得于禁超强护体神功，战场可减伤，属卖血技能，主防。受伤前一般概率触发，可减少自身受到的伤害。"
    },
    itemdesc321002: {
        i18n_id: "itemdesc321002",
        i18n_cn: "【风雾】能使敌军害怕，友军崇拜的自然系能力，属控场技能，主智。行动后易触发，可增加敌方全体下一次受到的伤害，同时减少血最少友军下一回合受到的伤害。"
    },
    itemdesc321015: {
        i18n_id: "itemdesc321015",
        i18n_cn: "【放权】阿斗能让攻最强的友军多出一份力，属控场技能，主智。行动前易触发，可回复自身一定血量，同时让己方1名武将额外行动一次。"
    },
    itemdesc322018: {
        i18n_id: "itemdesc322018",
        i18n_cn: "【勇决】糜夫人死亡时将对某个敌人造成伤害，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害。"
    },
    itemdesc351023: {
        i18n_id: "itemdesc351023",
        i18n_cn: "【红颜】小乔的红颜。装备后，可增加自身生命。"
    },
    itemdesc332017: {
        i18n_id: "itemdesc332017",
        i18n_cn: "【破袭】能对敌人造成剧烈伤害的古老战术，属攻击技能，主攻。行动时一般概率触发，可对敌方单体造成伤害。"
    },
    itemdesc341006: {
        i18n_id: "itemdesc341006",
        i18n_cn: "【崩坏】董卓的采阴补阳之术，能够延年益寿，属被动技能，主血。装备后，可增加自身血量。"
    },
    itemdesc342009: {
        i18n_id: "itemdesc342009",
        i18n_cn: "【授业】南华老仙传授的技能，可保护己方弱者，属控场技能，主智。行动前易触发，可减少场上血最少己方武将下一次所受伤害。"
    },
    itemdesc303104: {
        i18n_id: "itemdesc303104",
        i18n_cn: "【箭雨】以武力取胜的方法之四，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    itemdesc302104: {
        i18n_id: "itemdesc302104",
        i18n_cn: "【锋矢】能使人增加攻击力的阵法，属被动技能，主攻。装备后，可增加自身攻击力。"
    },
    itemdesc351014: {
        i18n_id: "itemdesc351014",
        i18n_cn: "【集智】获得黄月英集智的能力。装备后，增加自身智力。"
    },
