    surrunderdesc_4: {
        i18n_id: "surrunderdesc_4",
        i18n_cn: "听闻主公不仅礼贤下士，还很会用人，有决断力，我想与您共同拯救国家危难，共创建王称霸大业！"
    },
    surrunderdesc_14: {
        i18n_id: "surrunderdesc_14",
        i18n_cn: "荀大人说主公乃旷世奇才，有一统三国之志，在下愿为主公谋划效命！"
    },
    surrunderdesc_24: {
        i18n_id: "surrunderdesc_24",
        i18n_cn: "司马懿这个奸相，总感觉他要毒死我，主公你快救救我吧！"
    },
    surrunderdesc_34: {
        i18n_id: "surrunderdesc_34",
        i18n_cn: "这些年我一直跟着领导东征西讨捡肥皂，内心创伤无数，终于听说主公你不是GAY，我好高兴，我来投奔你了！"
    },
    surrunderdesc_44: {
        i18n_id: "surrunderdesc_44",
        i18n_cn: "主公，听闻您打败了曹操，您才是真正的英雄啊，带我去杀了他吧！曹操斩了我三族近三百余口人，我与他不共戴天！"
    },
    surrunderdesc_54: {
        i18n_id: "surrunderdesc_54",
        i18n_cn: "遇见你是最美的意外~"
    },
    surrunderdesc_64: {
        i18n_id: "surrunderdesc_64",
        i18n_cn: "我大哥说你行，你就行！我以后跟你混了，就这么愉快的决定了！"
    },
    surrunderdesc_74: {
        i18n_id: "surrunderdesc_74",
        i18n_cn: "我能唱、能演、还能打！主公，你要是走了，就再也找不到我这样全面的人才了！"
    },
    surrunderdesc_84: {
        i18n_id: "surrunderdesc_84",
        i18n_cn: "(✿◡‿◡) 你若是真汉子，就收了小生吧… …"
    },
    surrunderdesc_94: {
        i18n_id: "surrunderdesc_94",
        i18n_cn: "主公，听说您最近玩三国杀人手不够？让我来凑个数吧？！"
    },
    surrunderdesc_104: {
        i18n_id: "surrunderdesc_104",
        i18n_cn: "袁术不立政务、品德，估计没啥大出息，主公让我跟随你吧！"
    },
    surrunderdesc_114: {
        i18n_id: "surrunderdesc_114",
        i18n_cn: "生命中总是有错过的遗憾，感谢你对我不离不弃，让我没有错过你！"
    },
    surrunderdesc_124: {
        i18n_id: "surrunderdesc_124",
        i18n_cn: "主公！如果你让我当你的大将军，我就让你见识见识我的飞熊军！"
    },
    surrunderdesc_134: {
        i18n_id: "surrunderdesc_134",
        i18n_cn: "我天生就是一块当领导的料，有很强的号召力，主公，以后有什么需要对外号召的事情，就交给我吧！"
    },
    surrunderdesc_144: {
        i18n_id: "surrunderdesc_144",
        i18n_cn: "主公，听说你救过我的家人，我没什么可回报的，就这一条贱命，以后就归你了！"
    },
    surrunderdesc_154: {
        i18n_id: "surrunderdesc_154",
        i18n_cn: "主公，听说董大胖儿谁都不惧，唯独怕你？！真的吗？那如果我做了您的手下，是不是以后就不会有人随便抢我的斧子乱砍人了？！"
    },
    surrunderdesc_164: {
        i18n_id: "surrunderdesc_164",
        i18n_cn: "想不到你一介后起之秀，竟也在我之上。我自知大势将去，你若不弃，我愿随你而去… … "
    },
    surrunderdesc_174: {
        i18n_id: "surrunderdesc_174",
        i18n_cn: "主公，有我在，水军训练可大成矣！"
    },
    surrunderdesc_184: {
        i18n_id: "surrunderdesc_184",
        i18n_cn: "要不是我春风得意过了头，又怎会败于关羽刀下，主公，你可要为我报仇啊！"
    },
    surrunderdesc_194: {
        i18n_id: "surrunderdesc_194",
        i18n_cn: "我相信童话，就像我相信梦想会变为现实；我相信我们注定会在一起，就像我相信我们会像今天这样再次相遇… …"
    },
