    "23101201": {
        i18n_id: "23101201",
        i18n_cn: "修罗赤兔"
    },
    "21100802": {
        i18n_id: "21100802",
        i18n_cn: "它是虎侯许褚的武器。许褚号称勇力过人，这决然离不开它的功劳。许褚在保护曹操时也一直携带着它。据说此斧极其锋锐，眨眼之间可斩敌首，使其毫无闪避之机。"
    },
    "21200602": {
        i18n_id: "21200602",
        i18n_cn: "此戟通体采用黑铁制作，双月牙，战斗力直追戟界的天皇巨星方天画戟。"
    },
    "22100102": {
        i18n_id: "22100102",
        i18n_cn: "八卦阵是由太极图像衍生出来的一个更精妙的阵法，它在古代是真实存在的，为战国时期孙膑首创。后来诸葛亮在阵中建了点将台，由弓兵和步兵守护，自己指挥变阵。夷陵之战，蜀汉惨败，赵云担心陆逊追来，但诸葛亮却说：“吾来之时携三万兵马可敌陆逊”。而这三万兵马其实就是指八阵图。后来陆逊果然追来，诸葛亮本可将其困死在八阵图内，但老丈人黄承彦却救了他，自此，东吴再也不敢进攻蜀国了。"
    },
    "22200102": {
        i18n_id: "22200102",
        i18n_cn: "此铠甲以吼狮装饰，狮头在胸口做怒吼状，一副老子天下无双的表情，穿上之后防御力暴增。"
    },
    "22300402": {
        i18n_id: "22300402",
        i18n_cn: "古代帝王将相才能穿戴的帽子，戴上就是身份的象征。"
    },
    "23100602": {
        i18n_id: "23100602",
        i18n_cn: "它是曹操的爱驹。高大威武，体态庄严，通体雪白，四蹄皆黄，气质高贵非凡，傲气不可一世。正因如此，曹操每每征战均不会让其出征，只在凯旋归来之时骑乘。"
    },
    "23200602": {
        i18n_id: "23200602",
        i18n_cn: "五虎将之一、马超的爱骑，马超坐此马杀得曹操割须弃袍，几乎裸奔。由于马超地处凉州，所以马名略带西域风格。"
    },
    "23400402": {
        i18n_id: "23400402",
        i18n_cn: "三国名驹，通体颜色为枣红色，因此得名枣红马，有因为与关羽的脸色相同，又称之为关马。"
    },
    "24100902": {
        i18n_id: "24100902",
        i18n_cn: "长坂坡之战，刘备战败而逃。曹操一直追至长板桥，但见张飞胡须倒立，瞪着圆眼，心中害怕中计，吓得掉头就跑。张飞见吓退了曹操，就将长坂桥拆掉，继续向汉津逃去。“过河拆桥”的典故即源于此。"
    },
    "24300102": {
        i18n_id: "24300102",
        i18n_cn: "传说三国时期，于吉，南华老仙，张角，左慈等诸位道人都会使用此法术。但使用此法术的时候一定要高喊，我代表雷神惩罚你。"
    },
    "21101502": {
        i18n_id: "21101502",
        i18n_cn: "关羽死后，半神半鬼，性情暴烈，整日游走于神鬼两界，此刀便是他后来魂游至地狱十八层所锻造的，其锻造时注入了鬼龙之魄，因而此刀极具杀伤力，有鬼龙之煞，相传此刀与关羽合体时，可杀人于无形，使人七窍流血而死。"
    },
