    surrunderdesc_5: {
        i18n_id: "surrunderdesc_5",
        i18n_cn: "相信在我之前，主公手下还未出现过猛将！"
    },
    surrunderdesc_15: {
        i18n_id: "surrunderdesc_15",
        i18n_cn: "乃蒙郎君一见钟情，故贱妾有感于心… …"
    },
    surrunderdesc_25: {
        i18n_id: "surrunderdesc_25",
        i18n_cn: "主公，曹操的青釭剑在我这儿，你要是带我混，我就送给你！"
    },
    surrunderdesc_35: {
        i18n_id: "surrunderdesc_35",
        i18n_cn: "再也不当苦逼的游泳教练了，还不如去当水兵！主公，不要走，我来啦！"
    },
    surrunderdesc_45: {
        i18n_id: "surrunderdesc_45",
        i18n_cn: "主公得我，可若鱼儿得水，步步高升！"
    },
    surrunderdesc_55: {
        i18n_id: "surrunderdesc_55",
        i18n_cn: "我希望能用一把钥匙，打开你心中的大门，而不是静静的等待门开… …"
    },
    surrunderdesc_65: {
        i18n_id: "surrunderdesc_65",
        i18n_cn: "曹操疑心很重，我其实活在水深火热之中啊，你能解救我么？"
    },
    surrunderdesc_75: {
        i18n_id: "surrunderdesc_75",
        i18n_cn: "主公，伦家再也不想拍征兵广告了，伦家想上战场拍写真，你说好嘛？！"
    },
    surrunderdesc_85: {
        i18n_id: "surrunderdesc_85",
        i18n_cn: "大丈夫生于乱世，当带三尺剑立不世之功！今后之路，我当与君共闯！"
    },
    surrunderdesc_95: {
        i18n_id: "surrunderdesc_95",
        i18n_cn: "别看我年轻！斩将夺旗，我可从来不输别人！"
    },
    surrunderdesc_105: {
        i18n_id: "surrunderdesc_105",
        i18n_cn: "主公，我箭射的很好，可以暗中保护你不受伤害！能让我留在你身边吗？！"
    },
    surrunderdesc_115: {
        i18n_id: "surrunderdesc_115",
        i18n_cn: "主公爱惜百姓的事迹，老夫早有耳闻，近日听说主公所辖之地有很多人需要医救，老夫为此前来，希望能一解百姓之疾苦！"
    },
    surrunderdesc_125: {
        i18n_id: "surrunderdesc_125",
        i18n_cn: "李傕这个混蛋，我感觉他老想暗害我，主公，你能不能保护我？"
    },
    surrunderdesc_135: {
        i18n_id: "surrunderdesc_135",
        i18n_cn: "我可不只会拿菜刀！主公，信我你就让我做你的先锋！"
    },
    surrunderdesc_145: {
        i18n_id: "surrunderdesc_145",
        i18n_cn: "有点闷骚，有点好色，别人都这么说我… …但我不生气！最近听说主公你那边妹子特别多！真的吗？我想为您效力！哪怕不要俸禄也行！"
    },
    surrunderdesc_155: {
        i18n_id: "surrunderdesc_155",
        i18n_cn: "主公，听说跟着你混就一定能走红？！真的吗？太好了！我好希望有妹子能记住我！"
    },
    surrunderdesc_165: {
        i18n_id: "surrunderdesc_165",
        i18n_cn: "有我陷阵营在，夏侯惇、刘备都不是我的对手！主公，你怎么看？！"
    },
    surrunderdesc_175: {
        i18n_id: "surrunderdesc_175",
        i18n_cn: "我知道，曹操嘴上嫌我有勇无谋，其实是怕我功高盖主，我也不想再跟他混了，你愿不愿意收留我？"
    },
    surrunderdesc_185: {
        i18n_id: "surrunderdesc_185",
        i18n_cn: "主公，我想借你之力，早日了结那吕蒙的性命。"
    },
    surrunderdesc_195: {
        i18n_id: "surrunderdesc_195",
        i18n_cn: "原来你早已看出我的悲伤，你就是那个会疼我的人，对吗？"
    },
