    "11100702": {
        i18n_id: "11100702",
        i18n_cn: "不甘平淡，夏侯惇俯首成为反贼手下的反将，妄想通过他的力量，强化自己。但这一切都是个阴谋，夏侯惇发现自己的力量都被反贼反嗜，自己无法做一丝一毫的反抗，他明白只有死才能解脱自己。被玩家杀死后，他吟出了东宫之子，其力无穷……这句诗，意在提醒玩家，也许反贼，是一个非常厉害的角色。"
    },
    "11201602": {
        i18n_id: "11201602",
        i18n_cn: "受荀彧推荐而成为曹操的谋士，十分被器重，但一生苦短，英年早逝。他死后，曹操希望找人代替他的职务，荀彧就向曹操推荐了郭嘉。"
    },
    "11301702": {
        i18n_id: "11301702",
        i18n_cn: "曹魏中后期将领，在与周瑜对战中，以一句“不出城一战乃懦夫行为”一鸣惊人，传说是英国“牛津”大学的创始人。"
    },
    "16401402": {
        i18n_id: "16401402",
        i18n_cn: "我叫黄雷，最初是张梁的副手，但张梁是个GAY，老是对我动手动脚的。后来我遇到了典韦，他真是个纯爷们儿，我投奔了他，典韦让我做了青州重锤兵，想当年我还和吕布打过仗，发现吕布特么也是个GAY。"
    },
    "12101002": {
        i18n_id: "12101002",
        i18n_cn: "他出生在一个落魄的靠砍柴为生的家庭里，年纪轻轻便英勇善战。他本为凉州军阀，因曹操的假道灭虢之计，起兵反曹，几乎让曹操丧命，曹操因而怒斩马超三族近三百口人。曹操曾表示：“马儿不死，吾无葬地也”。后来马超归降刘备，威名赫赫，屡立战功，临终前将唯一的亲人马岱托付于刘备。诸葛亮曾赞誉马超“兼资文武、雄烈过人、一世之杰”。"
    },
    "12200902": {
        i18n_id: "12200902",
        i18n_cn: "草莽小伙，原为冀州关家庄庄主关定之子，因喜爱关羽之女关银屏，主动要求加入蜀军阵营，在战场上屡立奇功，成为关羽副将，眼看着离关银萍越来越近，即将表白的时候，又一次战役大捷，关羽表彰关平勇猛善战，特收他作为义子。原本爱慕追逐的女神瞬间变成自己的妹妹，关平觉得自己比段正淳还不幸，但因忠于义父，从此将相思埋藏心底，苦练武功，成为蜀国名将。"
    },
    "12301102": {
        i18n_id: "12301102",
        i18n_cn: "富N代，家族资产过10亿，福布斯中国富豪排行榜前100名，最初给徐州牧陶谦打工，陶谦死后，投奔了刘皇叔，位居南郡太守，但和关羽不和，最后受到蛊惑而投降吴国，担任吴国将军，并为吴国征战天下。"
    },
    "16401102": {
        i18n_id: "16401102",
        i18n_cn: "我叫李敏高，因为刚上过春晚，人气爆棚，赵云为了推广自己签下了我，让我做了巴蜀大刀兵的代言人，想当年我还救过阿斗呢。"
    },
    "13201002": {
        i18n_id: "13201002",
        i18n_cn: "孙权长女，生母步练师，胞妹孙鲁育。曾嫁给周瑜的儿子周循，周循死后又改嫁全琮，号称“蛇蝎妖女全公主”。她谗害太子，谗杀胞妹，私通堂侄。且无才能，无远见，无德行，趋炎附势，睚眦必报，坏事做尽，如市井悍妇一般，堪称史上最卑鄙狠毒的女人。最终，机关算尽太聪明，反误了卿卿性命。"
    },
    "13202202": {
        i18n_id: "13202202",
        i18n_cn: "凌统的父亲，为人侠义有胆气，水性好，是不可多得的水军将领。早年便随孙策转战江东，是军中的先锋。孙权统军后，又随其征伐黄祖，最后不幸被甘宁射杀。"
    },
    "16404702": {
        i18n_id: "16404702",
        i18n_cn: "大家都知道当年诸葛亮草船借箭，和鲁肃一起忽悠走曹操十万支箭的事，但是有谁知道，当年我黄小明曾和诸葛亮同坐一条船，我特么也参与了这场大行动啊。"
    },
    "14101202": {
        i18n_id: "14101202",
        i18n_cn: "怀冠绝世武功，妄想称霸三国群雄，对意见相左者残忍弑杀。对权利与力量的追寻永无止境，主动找到反贼，成为第一个被控制的反将。被玩家解救后，设计玩家替他复仇，假装报恩告诉玩家反贼的所作所为：诏令世界，声闻于天……天下反将之多，已不可预计。"
    },
    "14202202": {
        i18n_id: "14202202",
        i18n_cn: "字无双，冀州牧韩馥麾下的头号猛将，堪称“上将”，擅使大斧，与吕布齐名，时有“关东潘凤，关西吕布”之说。诸侯联军讨伐董卓时，韩馥搞笑的说了一句：“吾有上将潘凤可斩华雄”。上将的盘古开天斧重达185斤，连关羽82斤的青龙偃月刀都远不能及。所以连关羽都不配称作上将，而潘凤竟被称为上将。结果华雄用了不到四分之一柱香的时间就将其斩杀，他最终“光荣”殉国了。"
    },
    "14302102": {
        i18n_id: "14302102",
        i18n_cn: "曹操的说客，在赤壁大战中企图劝说周瑜投降，反被周瑜摆下“群英会”，诱导他盗走假的张允、蔡瑁二人的“投降书”，以反间计除去了这二人。后却自以为立功，成为笑柄。"
    },
    "16405402": {
        i18n_id: "16405402",
        i18n_cn: "我叫黄海博，我是波才将军手下的一员重锤兵，有点闷骚、有点好色。我还曾参与过打败朱儁的战斗。我们作为杂牌军，却干掉了正规军，我感到很光荣。"
    },
    "16402402": {
        i18n_id: "16402402",
        i18n_cn: "我们西凉弩兵是韩遂将军手下的一支重要力量，一路跟着将军击败过皇甫嵩、张温、董卓、孙坚等众多名将，希望有一天，大家能像记住韩遂将军一样记住我郭大鹏。"
    },
    "13101102": {
        i18n_id: "13101102",
        i18n_cn: "孙权之妃，温柔可人，从不妒忌他人。当年与母亲流落江边，多亏孙权相救，才保留一命，心甘情愿委身孙权，并以此为荣。善解人意，处处以孙权为重，与孙权同心同德，孙权快乐，便是她最大的快乐，孙权有难，步练师必与他一同承担，后成为孙权最亲厚、最不能割舍的夫人。"
    },
    "13100202": {
        i18n_id: "13100202",
        i18n_cn: "他自幼追随孙策，以胆气著称。折节读书后，识见精博，克己让人，有国士之风，“士别三日，当刮目相待。”这句话便源指吕蒙。但孙权继位后，才逐渐受到重用。他曾勇斩陈就，破黄祖、朱光；智擒郝普、关羽。他一生忠于孙吴，尽心力筹谋。然英雄命短，他在42岁时便不治而亡。"
    },
    "18100202": {
        i18n_id: "18100202",
        i18n_cn: "一生游走于男人之间，却无法摆脱“棋子”的命运。容颜再美，生命却也不过是昙花一现。吕布白门楼命陨，她随之凋零，尽管摆脱了“棋子”的身份，却始终带着一丝不甘，带着一丝遗憾，带着一丝留恋；那些她日夜思念、深深爱过的人，开始在心底一一浮现……如果能够重来，即使痛苦，她也愿意承担。"
    },
    "17100402": {
        i18n_id: "17100402",
        i18n_cn: "固有王者相，奈何胭脂殇。漫卷天山雪，孤影莫自怜。"
    },
    "18100902": {
        i18n_id: "18100902",
        i18n_cn: "曾有“苍天已死，黄天当立”的信条驱动着他在乱世中逆天而行、独当一面，如今惟剩对反贼的怨恨与执念使他的魂魄游离世间、不得散去。这个不甘受反贼头子的役使而自殁的大贤良师并没能释怀反贼留给他的心结，反而在死后由于自我意识的缺失，给了反贼利用自己可乘之机。如今的他是持天赋之力、行逆天之事的傀儡，是充满了魔性的天公将军，但他的深处意志似乎还在渴求着一个机缘，来将自己永远地解放。"
    },
    "11100403": {
        i18n_id: "11100403",
        i18n_cn: "我要是再聪明一点就好了！"
    },
