    "31101602": {
        i18n_id: "31101602",
        i18n_cn: "【强袭】典韦的舍命保驾之技，自残后可狼性大发，属攻击技能，主攻。行动时一般概率触发，消耗自身少量血，即可对敌方单体造成剧烈伤害。"
    },
    "31201802": {
        i18n_id: "31201802",
        i18n_cn: "【才鉴】辛宪英能让敌人群死群伤的智慧，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害。"
    },
    "32101002": {
        i18n_id: "32101002",
        i18n_cn: "【铁骑】马超人马合一时，连敌方援军都无法幸免，属攻击技能，主攻。行动时易触发，可对敌方场上单体及其1名援军造成攻击伤害。"
    },
    "35102002": {
        i18n_id: "35102002",
        i18n_cn: "【无言】徐庶的无言忠贞，可使智力大增，属被动技能，主智。装备后，可增加自身智力。"
    },
    "33100302": {
        i18n_id: "33100302",
        i18n_cn: "【制衡】孙权的内政方针，能让自己加伤或减伤，属控场技能，主攻和防。行动前易触发，可增加自身下一次造成的伤害，或减少自身下一次受到的伤害。"
    },
    "33201102": {
        i18n_id: "33201102",
        i18n_cn: "【虎媚】小虎能够伤人的媚眼绝技，属攻击技能，主智。行动时一般概率触发，可对敌方单体造成智力伤害。"
    },
    "34100302": {
        i18n_id: "34100302",
        i18n_cn: "【离间】貂蝉能让敌方2名男性自相残杀的媚术，属控场技能，主智。行动前易触发，可对敌方2名男性武将造成智力伤害。"
    },
    "35300202": {
        i18n_id: "35300202",
        i18n_cn: "【谋阵】能使人智力大增的阵法，属被动技能，主智。装备后，可增加自身智力。"
    },
    "30310202": {
        i18n_id: "30310202",
        i18n_cn: "【追杀】以武力取胜的方法之二，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "30210202": {
        i18n_id: "30210202",
        i18n_cn: "【混元】能使人增加防御力的阵法，属被动技能，主防。装备后，可增加自身防御力。"
    },
    "31101202": {
        i18n_id: "31101202",
        i18n_cn: "【放逐】曹丕被触怒后即可伤敌亦可将其封印的能力，属卖血技能，主防。受到普通攻击伤后易触发，可对敌方单体造成防御伤害，同时将其封印2回合。"
    },
    "31101302": {
        i18n_id: "31101302",
        i18n_cn: "【据守】曹仁能在战场死守的能力，属控场技能，主攻，行动后易触发，可回复自身血量，同时减少自身下一次受到的伤害。"
    },
    "33101802": {
        i18n_id: "33101802",
        i18n_cn: "【激昂】小霸王孙策独创霸业之心，可对敌方脆皮进行秒杀，属攻击技能，主攻。行动时易触发，有几率连续对敌方单体造成攻击伤害，同时增加自身下一次造成的伤害。"
    },
    "38100402": {
        i18n_id: "38100402",
        i18n_cn: "【魔旋风】魔·凌统须臾间索取敌人性命的快攻之道，属攻击技能，主攻。行动时易触发，可对敌方随机2名场上武将造成攻击伤害，同时减少其下一次造成的伤害。"
    },
