    itemdesc311008: {
        i18n_id: "itemdesc311008",
        i18n_cn: "【遗计】郭嘉死前留下的最后一计，能让己方战友活得更久，属卖血技能，主防。受伤后易触发，可减少己方另外2名武将下一次受到的伤害。"
    },
    itemdesc312016: {
        i18n_id: "itemdesc312016",
        i18n_cn: "【筹书】戏志才死后能将血最少的敌人带走，属卖血技能，主防。阵亡时，可对场上血最少敌军造成防御伤害。"
    },
    itemdesc321006: {
        i18n_id: "itemdesc321006",
        i18n_cn: "【武圣】关羽对弱者可造成额外打击的要诀，属攻击技能，主攻。行动时易触发，可对敌方单体造成攻击伤害；若自身攻击力高于目标，则对其造成额外伤害。"
    },
    itemdesc321018: {
        i18n_id: "itemdesc321018",
        i18n_cn: "【血祭】关羽留给女儿的群殴秘术，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害。"
    },
    itemdesc322020: {
        i18n_id: "itemdesc322020",
        i18n_cn: "【陷嗣】能让防最高的敌人受到重大打击，属控场技能，主攻。行动前易触发，可增加场上防最高敌军下一次受到的伤害。"
    },
    itemdesc331009: {
        i18n_id: "itemdesc331009",
        i18n_cn: "【连营】陆逊能够秒杀敌人的秘计，属攻击技能，主智。行动时易触发，可对敌方单体造成智力伤害，有几率连续多次施放。"
    },
    itemdesc332019: {
        i18n_id: "itemdesc332019",
        i18n_cn: "【夺刀】潘璋即可伤敌亦可减少被敌所伤的看家本领，属控场技能，主攻。行动前易触发，可增加自身下一次造成的伤害，同时减少敌方单体下一次造成的伤害。"
    },
    itemdesc341008: {
        i18n_id: "itemdesc341008",
        i18n_cn: "【蛊惑】于吉乱世动摇人心的秘诀，可伤敌亦可强己，属攻击技能，主智。行动时一般概率触发，可对敌方全体造成智力伤害，或增加己方全体下一次造成的伤害。"
    },
    itemdesc342018: {
        i18n_id: "itemdesc342018",
        i18n_cn: "【符箓】黄金雷使的化身，可助己方血最少战友回血，属控场技能，主智。行动前易触发，可让场上血最少己方武将回复一定血量。"
    },
    itemdesc303106: {
        i18n_id: "itemdesc303106",
        i18n_cn: "【破甲】以武力取胜的方法之五，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    itemdesc302106: {
        i18n_id: "itemdesc302106",
        i18n_cn: "【鹤翼】能使人生命延长的阵法，属被动技能，主血。装备后，可增加自身血量。"
    },
    itemdesc351004: {
        i18n_id: "itemdesc351004",
        i18n_cn: "【倾国】透着甄姬的倾国倾城之貌。装备后，可增加自身防御力。"
    },
