    surrunderdesc_6: {
        i18n_id: "surrunderdesc_6",
        i18n_cn: "听闻主公征召军士，吾前来应征！愿永世效力！"
    },
    surrunderdesc_16: {
        i18n_id: "surrunderdesc_16",
        i18n_cn: "于千万人之中遇见你，于千万年之中，在时间无涯的荒野里，没有早一步，也没有晚一步，刚巧赶上，那也没有别的话可说，惟有轻轻一问：这些年，你特么死哪去了？！"
    },
    surrunderdesc_26: {
        i18n_id: "surrunderdesc_26",
        i18n_cn: "我爹死了， 以后谁还给我钱花呀？！是你么？"
    },
    surrunderdesc_36: {
        i18n_id: "surrunderdesc_36",
        i18n_cn: "主公，我枪使得又快又好，就让我给你当长枪兵嘛！好嘛？！"
    },
    surrunderdesc_46: {
        i18n_id: "surrunderdesc_46",
        i18n_cn: "人生有时就是这样戏谑，对他多年的等待终敌不过对你的一见倾心… … "
    },
    surrunderdesc_56: {
        i18n_id: "surrunderdesc_56",
        i18n_cn: "我以为，幸福早已下落不明，直到你在黑暗中为我带来了一线光明… …"
    },
    surrunderdesc_66: {
        i18n_id: "surrunderdesc_66",
        i18n_cn: "目下正直用人之际，不知道能不能在您这领个小官当当？"
    },
    surrunderdesc_76: {
        i18n_id: "surrunderdesc_76",
        i18n_cn: "主公，想看看我的超能力吗？！张飞都奈何不得哦！我以后可以保护你，免受来自妹子们的骚扰！不要工资！"
    },
    surrunderdesc_86: {
        i18n_id: "surrunderdesc_86",
        i18n_cn: "听说了主公最近的江湖事迹，我深感佩服，我愿为主公出生入死，抛头颅，洒热血，在所不惜！"
    },
    surrunderdesc_96: {
        i18n_id: "surrunderdesc_96",
        i18n_cn: "听闻主公最近开拓疆野，急需猛将，不要怕，有我在！"
    },
    surrunderdesc_106: {
        i18n_id: "surrunderdesc_106",
        i18n_cn: "主公，或许你还不知道渺小的我也曾被你救过一命，从那一刻起，我就想悄悄的跟在你身旁，我也想默默的守着你！"
    },
    surrunderdesc_116: {
        i18n_id: "surrunderdesc_116",
        i18n_cn: "失败并不可怕，痛苦并不可怜，只有怯懦才是可悲的！有胆量就来与我共享黄巾盛世吧！"
    },
    surrunderdesc_126: {
        i18n_id: "surrunderdesc_126",
        i18n_cn: "我们一个是你的手，一个是你的脚，一个用来拥抱和保护你，一个用来帮你向理想的目标迈进！"
    },
    surrunderdesc_136: {
        i18n_id: "surrunderdesc_136",
        i18n_cn: "我是波才，我爱吃菠菜，我是一大波黄巾军的头，最近总是有人追着要揍我，我听说你能保护我，真的么？真的么？"
    },
    surrunderdesc_146: {
        i18n_id: "surrunderdesc_146",
        i18n_cn: "我的枪法除了赵云无人能敌！听说主公你打败了赵云，真是太厉害了，赶快收留我吧！"
    },
    surrunderdesc_156: {
        i18n_id: "surrunderdesc_156",
        i18n_cn: "我曾做过谋财害命的事，后来我身上发生了好多不幸的事，如今我真的好想改邪归正，主公，你能给我一次做好人的机会吗？！"
    },
    surrunderdesc_166: {
        i18n_id: "surrunderdesc_166",
        i18n_cn: "曹操杀了我的好盆油，我再也不能和他愉快的玩耍了！主公，听说你要修理曹操，让我来助你一臂之力吧！"
    },
    surrunderdesc_176: {
        i18n_id: "surrunderdesc_176",
        i18n_cn: "帮二哥复仇的事，主公，你还记得否？"
    },
    surrunderdesc_186: {
        i18n_id: "surrunderdesc_186",
        i18n_cn: "主公，你喜欢我的学生装嘛？"
    },
    surrunderdesc_196: {
        i18n_id: "surrunderdesc_196",
        i18n_cn: "您负责挣钱养家，我负责貌美如花~"
    },
