    interService_Instruction: {
        i18n_id: "interService_Instruction",
        i18n_cn: "1. 主公等级达到40级时，可参加跨服争霸赛；\n\n2. 本届跨服争霸赛周期16天；比赛结束后，有一段间歇期，再举办下届跨服争霸赛，下届时间敬请期待；\n\n3. 比赛采用积分制，根据结束时玩家的积分排行，选出前100名玩家进入积分排行榜；\n\n4. 比赛开始后，系统会根据玩家实力进行匹配，从各个服务器中找出2个对手，玩家可以选择任意一个进行挑战，无论输赢，系统都会自动刷新一次对手；\n\n5. 玩家主动攻击，赢了可根据连胜数，获得不同积分；输了只得1积分；\n\n6. 玩家主动攻击失败后，连胜立即清零；且当日连胜会在次日0时清零；\n\n7. 玩家被攻击，赢了不获得积分；输了不扣除积分；\n\n8. 关于连胜：连胜局数越多，获得的积分越高：\n\n输1场：积分+1；\n\n1连胜：积分+2；\n\n2连胜：积分+3；\n\n3连胜：积分+4；\n\n4连胜：积分+5；\n\n5连胜：积分+6；\n\n6连胜：积分+7；\n\n7连胜：积分+8；\n\n8连胜：积分+9；\n\n9连胜：积分+10；\n\n10连胜：积分+10；\n\n11连胜：积分+10；\n\n……\n\n20连胜：积分+10；\n\n9. 玩家每日最高连胜数为20连胜，满20连胜后，若继续参战，"
    },
