    itemdesc351005: {
        i18n_id: "itemdesc351005",
        i18n_cn: "【天妒】能让郭嘉智力大增的秘诀，属被动技能，主智。装备后，可增加自身智力。"
    },
    itemdesc312017: {
        i18n_id: "itemdesc312017",
        i18n_cn: "【识断】曹操之妻卞皇后死后能让敌人陪葬，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害。"
    },
    itemdesc321007: {
        i18n_id: "itemdesc321007",
        i18n_cn: "【咆哮】张飞喝退敌军之技，能连续多次伤敌，属攻击技能，主攻。行动时易触发，可对敌方单体造成连续多次攻击伤害。"
    },
    itemdesc351019: {
        i18n_id: "itemdesc351019",
        i18n_cn: "【虎啸】云长留给关兴的祖传秘籍，苦练之后可攻击力大增，属被动技能，主攻。装备后，可增加自身攻击力。"
    },
    itemdesc322022: {
        i18n_id: "itemdesc322022",
        i18n_cn: "【忠言】能让智力最高的己方战友伤害变强，属控场技能，主智。行动前易触发，可增加场上智力最高己方武将下一次造成的伤害。"
    },
    itemdesc351024: {
        i18n_id: "itemdesc351024",
        i18n_cn: "【谦逊】陆逊的防人之心，属被动技能，主防。装备后，可增加自身的防御力。"
    },
    itemdesc332020: {
        i18n_id: "itemdesc332020",
        i18n_cn: "【直言】能对敌人造成剧烈伤害的能力，属攻击技能，主智。行动时一般概率触发，可对敌方单体造成智力伤害。"
    },
    itemdesc341011: {
        i18n_id: "itemdesc341011",
        i18n_cn: "【断肠】蔡文姬的求死之心，死亡后可永久封印敌人，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害，同时将其永久封印。"
    },
    itemdesc342020: {
        i18n_id: "itemdesc342020",
        i18n_cn: "【仗势】能对更多人造成伤害的力量，属攻击技能，主攻。行动时一般概率触发，可对敌方全体造成攻击伤害。"
    },
    itemdesc303107: {
        i18n_id: "itemdesc303107",
        i18n_cn: "【回枪】以武力取胜的方法之六，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    itemdesc302107: {
        i18n_id: "itemdesc302107",
        i18n_cn: "【冲轭】能使人增加智力的阵法，属被动技能，主智。装备后，可增加自身智力。"
    },
