    surrunderdesc_7: {
        i18n_id: "surrunderdesc_7",
        i18n_cn: "我庆幸自己一直坚持等一份宁缺毋滥的感情，才让我在茫茫人海中终于等到了你… …"
    },
    surrunderdesc_17: {
        i18n_id: "surrunderdesc_17",
        i18n_cn: "算命的说我爹太好色了，早晚害死我，若我换个爹就能躲过一劫！主公啊，你愿意当我爹么？"
    },
    surrunderdesc_27: {
        i18n_id: "surrunderdesc_27",
        i18n_cn: "人们都以为我是个背信弃义的小人，其实我何尝不想找一个明主啊！那个人是你么？！"
    },
    surrunderdesc_37: {
        i18n_id: "surrunderdesc_37",
        i18n_cn: "听说主公正在招重骑兵准备打孙权？我有经验，10年前我做模特的时候就跟他同台PK过，带上我吧？！"
    },
    surrunderdesc_47: {
        i18n_id: "surrunderdesc_47",
        i18n_cn: "你愿意跟官富二代做盆油吗？！我爸比是刘备！"
    },
    surrunderdesc_57: {
        i18n_id: "surrunderdesc_57",
        i18n_cn: "主公若有了我，就再也不需要保镖了！"
    },
    surrunderdesc_67: {
        i18n_id: "surrunderdesc_67",
        i18n_cn: "你我早就是老相识了，在你需要我的时候，我怎能不帮！"
    },
    surrunderdesc_77: {
        i18n_id: "surrunderdesc_77",
        i18n_cn: "主公，你见过会杀人的三寸不烂之舌么？！你先收了我，我就给你看！"
    },
    surrunderdesc_87: {
        i18n_id: "surrunderdesc_87",
        i18n_cn: "主公得我甘兴霸，足可敌张辽矣！"
    },
    surrunderdesc_97: {
        i18n_id: "surrunderdesc_97",
        i18n_cn: "我庆幸自己过去没有一丝抱怨，因为这一刻，我看到你身在幸福之中，而我正在向幸福靠近… …"
    },
    surrunderdesc_107: {
        i18n_id: "surrunderdesc_107",
        i18n_cn: "黄盖这个老东西，给我取个名字叫刘的花，真是土掉渣了，我再也不想跟他好好玩耍了，主公，可以让我留下吗？！"
    },
    surrunderdesc_117: {
        i18n_id: "surrunderdesc_117",
        i18n_cn: "我对于你的喜欢，其实一直都是有响应的，只是你太笨了，现在才知道… …"
    },
    surrunderdesc_127: {
        i18n_id: "surrunderdesc_127",
        i18n_cn: "听说主公最近在拓展海外业务，急需人才？我曾就职于袁绍帐下，担任首席谋士，经验丰富，如果你愿意，我可以到你帐下捡肥皂啊… …"
    },
    surrunderdesc_137: {
        i18n_id: "surrunderdesc_137",
        i18n_cn: "我虽然是董卓的女婿，但是时候该跟他划清界限了，听说您最近需要一个助手？您看我行么？"
    },
    surrunderdesc_147: {
        i18n_id: "surrunderdesc_147",
        i18n_cn: "一支穿云箭，千军万马来相见！主公，刚才是你在召唤我么？我来了，不要怕！"
    },
    surrunderdesc_157: {
        i18n_id: "surrunderdesc_157",
        i18n_cn: "主公，听说你打败过曹操、孙权这些牛人，我好崇拜你，可以让我当你的小跟班儿吗？！"
    },
    surrunderdesc_167: {
        i18n_id: "surrunderdesc_167",
        i18n_cn: "主公得我，可若鱼儿得水，步步高升！"
    },
    surrunderdesc_177: {
        i18n_id: "surrunderdesc_177",
        i18n_cn: "主公，可否助我一臂之力？"
    },
    surrunderdesc_187: {
        i18n_id: "surrunderdesc_187",
        i18n_cn: "主公，你喜欢吃果果吗？给你吃……"
    },
    surrunderdesc_197: {
        i18n_id: "surrunderdesc_197",
        i18n_cn: "嗷呜~主公，您还记得大明湖畔的萌酱嘛~"
    },
