    str_unionWar_desc: {
        i18n_id: "str_unionWar_desc",
        i18n_cn: "1.每周活跃度排名本服务器前16名的公会，可以进入本服公会战\n2.公会活跃度可以通过公会成员的日常捐献和日常行为来获得\n3.每周一的00:00:00至周四的14:00:00为活跃度统计时间\n4.只有获得本服公会战资格的公会成员，才可以报名公会战，报名起止时间为周四的14:00:00—周五的14:00:00\n5.未报名的玩家无法进入本次公会战\n6.只有公会的会长和副会长，可以进行公会战布阵操作，布阵起止时间为周五的14:00:00—周五的20:00:00，每隔2小时进行一次布阵以及战斗\n7.公会战一共分为6个战场，每个战场有不同的积分，获得更高总积分的公会获胜\n8.公会战的战斗不回血，死亡武将无法复活，直至本轮公会战结束\n9.16个公会将进行一共4轮的比赛，角逐出最后的本服公会战冠军\n10.在本服公会战中取得好成绩的公会，将有机会参与每周的跨服公会战\n11.每周的跨服公会战将会在周日举行\n"
    },
