    "11100902": {
        i18n_id: "11100902",
        i18n_cn: "曹操护卫，白目猛将，阳气充足而溢，经常放气促进身心健康。多次与“玩家”作战失利，他从来不考虑智商或者情商的问题，而是每次都更努力的锻炼身体，希望以武力成为战场上的常胜将军，导致身体肌肉虬结，如同铜墙铁壁，刀枪不入，军中将领都称呼他“肉盾”。"
    },
    "11201802": {
        i18n_id: "11201802",
        i18n_cn: "她的一生见证了整个动荡的三国时代。她出生那年，董大胖儿挟傀儡天子迁都长安，直到钟会西征灭蜀、司马氏颠覆魏政。吴国也在她死后11年，最终玩完了。她为人聪明有才，善于鉴人知事。她是历史的旁观者，但却不是局外人，她一生勤俭节约，最终用自己的才智保全了家人。"
    },
    "11301902": {
        i18n_id: "11301902",
        i18n_cn: "三国时期曹魏武将，官二代，老爸是为曹操献身的典韦。"
    },
    "16403602": {
        i18n_id: "16403602",
        i18n_cn: "我叫晓志，最初是左校旗下的司机，尼玛左校天天让我陪酒跳舞，身体吃不消。有一天曹洪发现我枪使得又快又好，就让我做了青州长枪兵，想当年我还和刘表打过仗。"
    },
    "12101402": {
        i18n_id: "12101402",
        i18n_cn: "又称孙夫人，铁娘子，美丽贤淑，智胜男儿，是孙权的胞妹，赤壁之战后嫁给刘备。孙权本欲借假婚之机，将刘备扣作人质，索回荆州，不料却反遭诸葛亮锦囊妙计，假婚成真，后又追逃未遂、损兵折将。“赔了夫人又折兵”典故即源于此。后来夫人被骗回东吴，便再也未能与夫君相见。刘备猇亭兵败后，被讹传死于军中，她便驱车江边，望西遥哭，投江而死。后人立庙江滨，号曰枭姬祠。"
    },
    "12201602": {
        i18n_id: "12201602",
        i18n_cn: "张飞的妻子，刘禅的丈母娘，魏夏侯渊的侄女，夏侯霸的堂妹，于采桑时为张飞所得，为其生了两个儿子和两个女儿。后来这两个女儿都成了蜀汉后主刘禅的皇后。"
    },
    "12301402": {
        i18n_id: "12301402",
        i18n_cn: "刘备的幕僚，最初被大儒郑玄推荐，自徐州跟随刘备，多次作为刘备的使臣，刘备定益州后，拜孙乾为秉忠将军，其待遇仅次于麋竺，不久便病逝。"
    },
    "16401502": {
        i18n_id: "16401502",
        i18n_cn: "我是金秀闲，我来自外星球，张飞看中了我的超能力，让我做了巴蜀长枪兵，想当年我还和吕布打过仗。"
    },
    "13201202": {
        i18n_id: "13201202",
        i18n_cn: "孙吴开国功臣，历仕孙坚、孙策、孙权三代。长于弓箭、骑术，膂力过人，深受孙坚赏识。曾于孙坚攻襄阳之时劝其班师，孙坚不听，导致大败并且丢掉性命。后从孙策平定江东，再佐孙权。赤壁之战，大破蔡瑁，后斩焦触，与周泰合力败文聘，救黄盖。濡须口之战，还曾与周泰合力三十回合战平许褚。他一生戎马，功勋卓著，一定想不到他死后，儿子却淫乱不轨，最终叛逃降魏，还反过来残害吴国百姓。"
    },
    "13300702": {
        i18n_id: "13300702",
        i18n_cn: "三国时期吴国名将，老婆是孙权的女儿孙鲁班，官至右大司马、左军师，曾建议孙权讨伐关羽，在孙权成功擒拿关羽之后，被加官进爵。"
    },
    "16404902": {
        i18n_id: "16404902",
        i18n_cn: "看过火么？看过大火么？作为参加过赤壁之战的一名老兵，我想劝说小朋友尽量不要玩火。我自从被火烧过眉毛以后，再也不敢乱玩火了。"
    },
    "14200902": {
        i18n_id: "14200902",
        i18n_cn: "张角的师父，属于仙人级。他将三卷天书太平要术传给张角，让他普救世人。据传南华老仙就是与老子并肩、主张无为的庄子。而他写的《庄子》通称《南华经》。所以《太平要术》就是庄子的《南华经》。后世道教追尊庄周为南华真人，南华老仙是指南华真人得道升天后入世的一种化名。"
    },
    "14300102": {
        i18n_id: "14300102",
        i18n_cn: "东汉末年大臣，貂蝉的义父，在和中常侍张让的斗争中失败，在何进时期重新执政，在董卓掌权时，官至司徒兼尚书令。由于朝廷腐败，从而密谋刺杀董卓。董卓死后，王允与吕布共执朝政，后来董卓余党攻破长安，吕布出逃，王允被处死。"
    },
    "14302302": {
        i18n_id: "14302302",
        i18n_cn: "刘表外甥、部将。在投降曹操后位列将军，与蔡瑁一起统领水军，虽于赤壁之战初期战败于吴国水军。周瑜用反间计，通过曹操的说客蒋干“偷走”蔡瑁、张允二人的投降书，致使二人被曹操斩首。"
    },
    "16405602": {
        i18n_id: "16405602",
        i18n_cn: "我是德缸，由于袁公特别看重许攸大人，派我来守卫许攸大人，但是我感觉许攸大人好像不怎么忠心于袁公，果然后来他就叛变了，但是谁又会听一个小兵的话呢。哎，我还是安安心心做一个小兵吧。"
    },
    "16402702": {
        i18n_id: "16402702",
        i18n_cn: "徐荣你们认识么？当年击败过曹操，还战胜过孙权的猛将，他就我王大丫的主将。"
    },
    "14101402": {
        i18n_id: "14101402",
        i18n_cn: "和颜良共称河北双雄，颜良惨死沙场后，故意纵容部下军营作乱，以泄心中不满，终于导致逢纪及其他大将的不悦。数日后，双方冲突升级，为稳定军心，逢纪派刺客刺杀文丑，但被文丑识破。逢纪恶人先告状，促使袁绍次日派文丑先行对敌，死于曹操手下。"
    },
    "12101902": {
        i18n_id: "12101902",
        i18n_cn: "和刘备一起闯荡菜市，穿皮裤、打鼻环，羞辱一众菜场恶霸。有勇有谋的一把好手。眼光狠毒，一眼就能看出谁家短斤缺两，谁家品质上乘，谁家用了地沟油，谁家是京城特供。知道顺应时节顺应节气，知道该用什么人做什么事，被众人称为“伯乐”。提供“天火锻”的下落，劝刘备请诸葛亮出山，是刘备重要的臣子和朋友。"
    },
    "11101202": {
        i18n_id: "11101202",
        i18n_cn: "曹操与卞夫人的长子，文武双全，野心远超父亲的阴谋家。表面看上去爱好美色，纵情享乐，连玩家也忽略了他的重要性，实际却暗自积攒实力，不容许任何人觊觎他太子的宝座，但凡有人入侵，即使是他的血脉至亲也不轻易放过。甄姬最怕的人就是他，或许，这里面有什么难言之隐？"
    },
    "18100402": {
        i18n_id: "18100402",
        i18n_cn: "每天日落时分，都会有个头发散乱的男子，布衣裹身，赤脚沾地，手握长枪，独坐在窗边醉饮。他身材高大，英俊的脸上有着淡淡的小胡茬，空洞而呆滞的目光中透露着一丝不舍与无奈。他看起来年近三十，却满是沧桑，彷佛即将走到人生的尽头……他就是凌统，这一年，他29岁，旧伤复发的他，自知命不久矣，诸多无奈与彷徨纷纷涌上心头，唯有一醉解千愁。然而没有人注意到，在窗边还散落着一封奇怪的信，是一个自称“反贼头子”的人写给他的，据说可以让他以另一种身份活下去，并且变得更强大，只是会让人忘记过去的一切……想到这里，他拿起酒壶，想再狂饮一番，却发现酒壶早已空空。他默默地垂下了头，心中不禁问道：“这样真的好吗？”......"
    },
    "19400102": {
        i18n_id: "19400102",
        i18n_cn: "生命诚可贵，爱情价更高，若为松果故，两者皆可抛。（宠物们主要作为战技升级材料，可在战技升级时吃掉，好吃你就多吃点。）"
    },
