    "21100102": {
        i18n_id: "21100102",
        i18n_cn: "即双耳画戟，它兼备刀枪钩叉的诸多特点，极难运用，可克制刀和枪，是吕布最擅长的兵器，往往可瞬间脆败对手，连曹操手下头号武将夏侯惇也抵挡不住。但据说历史上第一个将戟改为方天画戟并发扬光大的人是项羽。他按照楚国第一美人虞姬所画之图，请天下第一铸剑师耗时一月打造而成，因此也叫姬画。后改为“方天画戟”。它的缺点是变招的间期长，一击不中则会留下空当，给对方反击的机会。且用刀反复劈砍比较耗体力，不利于久战。"
    },
    "21101102": {
        i18n_id: "21101102",
        i18n_cn: "此枪全名龙胆亮银枪，是赵云的武器。据说该枪为赵云家传之宝，他哥哥死后传于他手。长坂坡大战时，赵云杀夏侯恩，夺青釭剑，将龙胆枪与青釭剑并用，才最终杀出重围，救出了糜竺、甘夫人和小阿斗。"
    },
    "21300202": {
        i18n_id: "21300202",
        i18n_cn: "双面开刃的短斧，这是一把什么样的斧头，它砍杀过多少敌人，沾过多少鲜血，才能得到如此霸气的名字！此等装备你值得拥有！"
    },
    "22100402": {
        i18n_id: "22100402",
        i18n_cn: "它是马超的专属防具。曾经许褚裸衣斗马超，许胖子赤膊上阵，马超能与其大战三百回合而未分胜负，正是多亏有它的存在。如今有了白银狮子，马超再也不害怕许褚了。"
    },
    "22200402": {
        i18n_id: "22200402",
        i18n_cn: "传说中用青龙鳞片制作而成的头盔，穿了之后犹如青龙附体，斧砍不动，刀砍不伤。"
    },
    "22400302": {
        i18n_id: "22400302",
        i18n_cn: "仅次于金属甲胄的防御装备，要是放在现代属于皮草一类的奢侈品了。"
    },
    "23100902": {
        i18n_id: "23100902",
        i18n_cn: "它是张飞的马，为关外名驹，千里绝群，曾在长坂桥上与三将军共退大魏雄师，为马中英雄。据说此马和张飞一般黑，若是晚上出行，几乎无人能识。"
    },
    "23300202": {
        i18n_id: "23300202",
        i18n_cn: '产自西域的马，当年的汉武帝看到它，顿时被它折服，还写了首歌，歌词是这样的"天马徕兮从西极，经万里兮归有德……"'
    },
    "24100202": {
        i18n_id: "24100202",
        i18n_cn: "《孙子兵法》有云：“攻其无备，出其不意”。而“无懈可击”即来源于曹操对其的注解：“击其懈怠，出其空虚”。"
    },
    "24200102": {
        i18n_id: "24200102",
        i18n_cn: "“五谷”指五种谷物。“丰登”谓丰年之意。此计用了之后保证风调雨顺，仓满鱼肥啊。"
    },
    "24300402": {
        i18n_id: "24300402",
        i18n_cn: "大雾天，一般人的视线都会因为这个天气看不清楚，当年诸葛亮就是趁着大雾天，带着鲁肃，一边喝酒一边骗了曹操100000多支好箭。"
    },
    "22101102": {
        i18n_id: "22101102",
        i18n_cn: "上古时代的战神蚩尤生前带过的面甲，这件保护过蚩尤无数次的铜制装备随着蚩尤的战败同归大地，而蚩尤的戾气却没有消散，反被面具所吸纳。这股与日俱增的戾气夹杂着蚩尤战败的不甘，在时光的流转中渐渐赋予了这面具若有若无的乖戾心性以及极不寻常的外形和强度。寻求武之巅峰的吕布与对战意有着无限诉求的面具不谋而合，面具得以重见天日——这次归来的，是真正的邪神。"
    },
