    "31100402": {
        i18n_id: "31100402",
        i18n_cn: "【洛神】甄姬可秒杀敌人的绝密武功，属控场技能，主智。行动前易触发，有几率连续多次增加自身造成智力伤害的能力。"
    },
    "31102102": {
        i18n_id: "31102102",
        i18n_cn: "【贞烈】王异与敌人同归于尽的决心，属卖血技能，主防。阵亡时，可对敌方单体造成剧烈防御伤害。"
    },
    "31202002": {
        i18n_id: "31202002",
        i18n_cn: "【肃整】朱灵能让敌人受到深入打击的治军之道，属控场技能，主智。行动前易触发，可使敌方单体下一次受到的伤害增加。"
    },
    "32101102": {
        i18n_id: "32101102",
        i18n_cn: "【火计】孔明火烧赤壁之计，随便动动脑，可使敌人全军覆没，属攻击技能，主智。行动时易触发，可对敌方场上全体造成智力伤害。"
    },
    "32201002": {
        i18n_id: "32201002",
        i18n_cn: "【当先】廖化能够先下手为强的秘诀，属控场技能，主攻。行动前易触发，可对敌方单体造成连续两次攻击伤害。"
    },
    "33100802": {
        i18n_id: "33100802",
        i18n_cn: "【天香】能让小乔免伤并反弹给敌人的魅力，属卖血技能，主防。受伤前易触发，可免受本次伤害，同时对敌方单体造成防御伤害。"
    },
    "33201602": {
        i18n_id: "33201602",
        i18n_cn: "【短兵】丁奉不怕死的秘诀，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害。"
    },
    "34100402": {
        i18n_id: "34100402",
        i18n_cn: "【青囊】能获得血最少友军的信任，属控场技能，主智。行动前易触发，可回复场上血最少己方武将一定血量。"
    },
    "34200902": {
        i18n_id: "34200902",
        i18n_cn: "【授业】南华老仙传授的技能，可保护己方弱者，属控场技能，主智。行动前易触发，可减少场上血最少己方武将下一次所受伤害。"
    },
    "30310402": {
        i18n_id: "30310402",
        i18n_cn: "【箭雨】以武力取胜的方法之四，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "30210402": {
        i18n_id: "30210402",
        i18n_cn: "【锋矢】能使人增加攻击力的阵法，属被动技能，主攻。装备后，可增加自身攻击力。"
    },
    "32101302": {
        i18n_id: "32101302",
        i18n_cn: "【枪舞】张星彩可扰乱敌人全军的枪法，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害。"
    },
    "34200502": {
        i18n_id: "34200502",
        i18n_cn: "【眀策】陈宫能让己方最聪明的战友多出一份力的计策，属控场技能，主智。行动前一般概率触发，可增加场上智最高友军下一次造成的伤害，并让其额外进行一次普通攻击。"
    },
    "35101102": {
        i18n_id: "35101102",
        i18n_cn: "【七星】能激活北斗七星的神力，使智力及防御大增，属被动技能，主智和防。装备后，可增加自身智力和防御力。"
    },
    "33100102": {
        i18n_id: "33100102",
        i18n_cn: "【炎神】获得上古炎神之助，使智力及血量大增，属被动技能，主智和血。装备后，可增加自身的智力和血量。"
    },
    "38100102": {
        i18n_id: "38100102",
        i18n_cn: "【魔咆哮】魔·张飞以一挡十的护主之技，属卖血技能，主防。受伤后易触发，可对敌方单体造成连续多次防御伤害。"
    },
    "38100702": {
        i18n_id: "38100702",
        i18n_cn: "【魔雷击】魔·张角逆天改命、伤敌性命取其命数的太平道法，属控场技能，主智。行动后易触发，可对敌方单体造成智力伤害，并吸收伤害值对应的血量."
    },
