    surrunderdesc_8: {
        i18n_id: "surrunderdesc_8",
        i18n_cn: "有我作智囊，主公大事可成矣！"
    },
    surrunderdesc_18: {
        i18n_id: "surrunderdesc_18",
        i18n_cn: "我观人可谓多矣，无一人能比主公，这才是真明主啊！今既已相遇，除了为您效命，我还有什么奢望呢？"
    },
    surrunderdesc_28: {
        i18n_id: "surrunderdesc_28",
        i18n_cn: "我力气大得很，主公，让我来帮你拿锤子吧！"
    },
    surrunderdesc_38: {
        i18n_id: "surrunderdesc_38",
        i18n_cn: "其实我是个伟大的导演，主公，听说你这次要去赤壁？带上我吧，正好有个叫赤壁之战的片子要我拍一下。"
    },
    surrunderdesc_48: {
        i18n_id: "surrunderdesc_48",
        i18n_cn: "诸葛亮胆怯，吾之才恨不能尽用，今日有缘得遇主公，愿誓死追随！"
    },
    surrunderdesc_58: {
        i18n_id: "surrunderdesc_58",
        i18n_cn: "我孤零零的一个人，无亲无故，你愿意收留我吗？"
    },
    surrunderdesc_68: {
        i18n_id: "surrunderdesc_68",
        i18n_cn: "还记得那一年我们一起谈天说地吗？还记得我们的十年之约吗？我来了，让我们一起渡江南下！"
    },
    surrunderdesc_78: {
        i18n_id: "surrunderdesc_78",
        i18n_cn: "我愿与君共享东吴基业，不知君是否愿与我一统三国？！！"
    },
    surrunderdesc_88: {
        i18n_id: "surrunderdesc_88",
        i18n_cn: "我壮志未酬，乡亲们就先死光了，听说您在招志愿军，若不嫌弃我老哥一个，我就从了你……"
    },
    surrunderdesc_98: {
        i18n_id: "surrunderdesc_98",
        i18n_cn: "听闻主公所辖之地，常受盗贼骚扰，但有我在，可保主公永世不受侵扰！"
    },
    surrunderdesc_108: {
        i18n_id: "surrunderdesc_108",
        i18n_cn: "主公，听说你打败了诸葛亮，我可以拜你为师吗？！周瑜是我干爹，我想为他报仇！"
    },
    surrunderdesc_118: {
        i18n_id: "surrunderdesc_118",
        i18n_cn: "我可为主公医治百病，还可为主公取得民心… …"
    },
    surrunderdesc_128: {
        i18n_id: "surrunderdesc_128",
        i18n_cn: "我习惯摔倒了等你来扶，因为只有这样，我才知道，原来你一直都在… …"
    },
    surrunderdesc_138: {
        i18n_id: "surrunderdesc_138",
        i18n_cn: "我曾是一名好猎手，现在是一名好弩兵，我射箭可准了，听说主公需要我这样的人才，所以我这就来了！"
    },
    surrunderdesc_148: {
        i18n_id: "surrunderdesc_148",
        i18n_cn: "主公，听说你跟我家将军是总角之交，前些天我家将军被杀了，我想只有你有能力为我家将军报仇雪恨了！"
    },
    surrunderdesc_158: {
        i18n_id: "surrunderdesc_158",
        i18n_cn: "主公，听说你一直在寻找反贼头子，如果你能收留我，我就把我知道的线索都告诉你！"
    },
    surrunderdesc_168: {
        i18n_id: "surrunderdesc_168",
        i18n_cn: "我的好兄弟孙策去了，我实在看不惯他弟弟孙权那犹豫不决的样子，不知主公是否愿意让我来辅佐您？！"
    },
    surrunderdesc_178: {
        i18n_id: "surrunderdesc_178",
        i18n_cn: "主公，若我不再离开，我们可否重来？"
    },
    surrunderdesc_188: {
        i18n_id: "surrunderdesc_188",
        i18n_cn: "主公，你不叫我的昵称，我们还是好盆油！"
    },
    surrunderdesc_198: {
        i18n_id: "surrunderdesc_198",
        i18n_cn: "你与所有人都不同。吾之武勇，今后就为你所用吧！"
    },
