    "24400201": {
        i18n_id: "24400201",
        i18n_cn: "死守"
    },
    "21100202": {
        i18n_id: "21100202",
        i18n_cn: "因靶上有金嵌“青釭”二字，故名青釭剑，是曹操的宝剑，一直让夏侯恩使用。但夏侯恩却带着它到处招摇，不想撞到赵云，被一枪刺死，宝剑被夺。后在关三小姐关银屏大婚之时作为贺礼赠予，此后关银屏常背此剑出战。她死后，该剑与张飞所赠宝珠一起埋葬。据说有盗墓贼已将这两件宝物盗走，但离开时因顾忌关索庙宇遍布各地而选择水路，结果中途翻船而死，两件宝物则自此沉于水中。"
    },
    "21101202": {
        i18n_id: "21101202",
        i18n_cn: "它原本是吕布的武器，后归于蜀将黄忠。此弓射程极远，威力巨大，一箭便可人马俱伤，是难得的好兵器。加之黄爷爷力大无穷，百发百中，他使用此弓可谓如虎添翼。"
    },
    "21300302": {
        i18n_id: "21300302",
        i18n_cn: "它射出去的箭犹如流星一般，因此得名。此弓足可与麒麟弓媲美！"
    },
    "22100502": {
        i18n_id: "22100502",
        i18n_cn: "对于四方神灵，山海经曾说：东方有句芒，身鸟人面，乘两龙。因东为青色，所以这里的龙便指的是青龙。据说，每到冬春之交的傍晚，青龙便会显现。青龙落鳞化而为铠，无比坚硬却轻如鸿毛，相传是子龙驰骋沙场的最爱。"
    },
    "22200502": {
        i18n_id: "22200502",
        i18n_cn: "原为水镜先生的专用装备，可以帮助您安然度过三国的乱世。"
    },
    "22400402": {
        i18n_id: "22400402",
        i18n_cn: "古代文士穿着的衣服，穿上之后风度翩翩，真是羡煞旁人。"
    },
    "23101002": {
        i18n_id: "23101002",
        i18n_cn: "它黄而带红，具有黑色鬃毛和尾巴。骅骝源于古突厥地区，名字为古突厥语的音译。它被视为一种吉祥的马，被古突厥人称为“太阳马”，是多为皇家成员使用的珍奇和高贵的坐骑。此马高大，瘦削，跑起来迅捷得象一阵狂风。"
    },
    "23300302": {
        i18n_id: "23300302",
        i18n_cn: "关外名驹。“王追”，永远追随者王者的马。你也将会是它一生追随的对象。"
    },
    "24100302": {
        i18n_id: "24100302",
        i18n_cn: "该典故源于张角。南华老仙将《太平要术》传于张角后，张角连夜攻习，终能呼风唤雨。南华老仙希望他能够善用此术，普救世人，张角遂以此为己任。他惯用闪电，专劈恶势力。不过因为技术不够熟练，有时也会劈到自己。"
    },
    "24200202": {
        i18n_id: "24200202",
        i18n_cn: "话说当年刘备、关羽和张飞三位仁人志士，为了共同干一番大事业的目标，意气相投，言行相依，选在一个桃花盛开的季节、选在一个桃花绚烂的园林，举酒结义，对天盟誓，有苦同受，有难同当，有福同享，共同实现自己人生的美好理想。"
    },
    "24300502": {
        i18n_id: "24300502",
        i18n_cn: "当年曹操，派曹仁和曹洪大军进攻新野。诸葛亮料新野守不住了，就留下空城。曹军进城之后住入了民房。夜里狂风大作，埋伏在城外的刘备军往城里射火箭。大火迅速烧起来。曹兵逃奔出城，被刘备军截杀，大败而归。所谓风助火势，大风天也是使用火计的最佳时刻。"
    },
