    "35100402": {
        i18n_id: "35100402",
        i18n_cn: "【倾国】能让甄姬长久不败的魅力所在，属被动技能，主防。装备后，可增加自身防御力。"
    },
    "35100802": {
        i18n_id: "35100802",
        i18n_cn: "【秘计】让王异热血沸腾的退敌之计，属被动技能，主血。装备后，可增加自身血量。"
    },
    "31202102": {
        i18n_id: "31202102",
        i18n_cn: "【峻刑】满宠的执法之道，能扼制攻击最高的敌人，属控场技能，主智。行动前易触发，可使场上攻最高敌军下一次造成伤害减少。"
    },
    "35101602": {
        i18n_id: "35101602",
        i18n_cn: "【八阵】孔明所创的防御阵法，属被动技能，主防。装备后，可增加自身防御力。"
    },
    "32201602": {
        i18n_id: "32201602",
        i18n_cn: "【燕语】能抗锤子的女人，自然一个顶三个，属攻击技能，主攻。行动时一般概率触发，可对敌方场上全体造成攻击伤害。"
    },
    "35102302": {
        i18n_id: "35102302",
        i18n_cn: "【红颜】谁说红颜多薄命，能让小乔延续生命的秘密，属被动技能，主血。装备后，可增加自身血量。"
    },
    "33201702": {
        i18n_id: "33201702",
        i18n_cn: "【破袭】能对敌人造成剧烈伤害的古老战术，属攻击技能，主攻。行动时一般概率触发，可对敌方单体造成伤害。"
    },
    "34100502": {
        i18n_id: "34100502",
        i18n_cn: "【雷击】能让张角免伤并反弹给血最多敌人的能力，属卖血技能，主防。受伤前易触发，有几率闪避本次伤害，同时对场上血最多敌军造成防御伤害。"
    },
    "34201002": {
        i18n_id: "34201002",
        i18n_cn: "【血殇】能使人攻击性暴增的力量，属攻击技能，主攻。行动时一般概率触发，可对敌方单体造成攻击伤害。"
    },
    "30310502": {
        i18n_id: "30310502",
        i18n_cn: "【谋害】以智力取胜的方法，已在士兵中普及，属攻击技能，主智。行动时较困难触发，可对敌方单体造成智力伤害。"
    },
    "30210502": {
        i18n_id: "30210502",
        i18n_cn: "【鱼鳞】能使人增加防御力的阵法，属被动技能，主防。装备后，可增加自身防御力。"
    },
    "33100402": {
        i18n_id: "33100402",
        i18n_cn: "【反间】周瑜操纵虚实、将对手分化离间的分敌之法，属攻击技能，主智。行动时易触发，可对敌方单体造成不定量的智力伤害，并无视其部分防御。"
    },
    "32100202": {
        i18n_id: "32100202",
        i18n_cn: "【风雾】能使敌军害怕，友军崇拜的自然系能力，属控场技能，主智。行动后易触发，可增加敌方全体下一次受到的伤害，同时减少血最少友军下一回合受到的伤害。"
    },
    "33102302": {
        i18n_id: "33102302",
        i18n_cn: "【琴音】能掌控世界的自然之音，敌军听了会死伤，友军听了可疗伤，属控场技能，主智。行动后易触发，可对敌方全体造成智力伤害，同时回复己方全体一定血量。"
    },
    "10000102": {
        i18n_id: "10000102",
        i18n_cn: "【狂骨】魏延可在攻击的同时吸血，属攻击技能，主攻。行动时一般概率触发，可对敌方单体造成攻击伤害，同时吸收其血量。"
    },
    "38100502": {
        i18n_id: "38100502",
        i18n_cn: "【魔崩坏】魔·董卓通过酒池肉林提升己方寿命，属被动技能，主血。装备后，可增加己方全体血量。魔·董卓作为伙伴时也能触发技能效果。"
    },
