    itemdesc311015: {
        i18n_id: "itemdesc311015",
        i18n_cn: "【绝情】春哥能让敌人无法发动技能的绝技，属控场技能，主攻。行动前易触发，可对敌方单体造成攻击伤害，同时将其封印2回合。"
    },
    itemdesc312019: {
        i18n_id: "itemdesc312019",
        i18n_cn: "【慷忾】曹昂能以死抵御血最多的敌人，属卖血技能，主防。阵亡时，可对场上血最多敌军造成防御伤害。"
    },
    itemdesc321010: {
        i18n_id: "itemdesc321010",
        i18n_cn: "【铁骑】马超人马合一时，连敌方援军都无法幸免，属攻击技能，主攻。行动时易触发，可对敌方场上单体及其1名援军造成攻击伤害。"
    },
    itemdesc322009: {
        i18n_id: "itemdesc322009",
        i18n_cn: "【龙吟】能让敌方血最少的人小命不保，属攻击技能，主攻。行动时一般概率触发，可对敌方血量最少单体造成伤害，还有机会追加一次伤害。"
    },
    itemdesc331023: {
        i18n_id: "itemdesc331023",
        i18n_cn: "【琴音】能掌控世界的自然之音，敌军听了会死伤，友军听了可疗伤，属控场技能，主智。行动后易触发，可对敌方全体造成智力伤害，同时回复己方全体一定血量。"
    },
    itemdesc331015: {
        i18n_id: "itemdesc331015",
        i18n_cn: "【不屈】周泰的性格，战场中可屹立不倒，属卖血技能，主防。血量为0时必定触发，可承受额外伤害。"
    },
    itemdesc332022: {
        i18n_id: "itemdesc332022",
        i18n_cn: "【独进】能够反击敌人的力量，属卖血技能，主防。受伤后一般概率触发，可对敌方单体造成防御伤害。"
    },
    itemdesc342002: {
        i18n_id: "itemdesc342002",
        i18n_cn: "【陷阵】能穿透敌人防具的冲锋之勇，属攻击技能，主攻。行动时一般概率触发，可对敌方单体造成攻击伤害，无视其部分防御。"
    },
    itemdesc353004: {
        i18n_id: "itemdesc353004",
        i18n_cn: "【御阵】能使人在战场活的更久的阵法，属被动技能，主防。装备后，可增加自身防御力。"
    },
    itemdesc303109: {
        i18n_id: "itemdesc303109",
        i18n_cn: "【暗袭】以武力取胜的方法之八，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    itemdesc362001: {
        i18n_id: "itemdesc362001",
        i18n_cn: "【经验金书】能使任意技能获得中量提升的金书。在技能升级界面吃掉后，可获得中量技能经验。"
    },
    itemdesc351031: {
        i18n_id: "itemdesc351031",
        i18n_cn: "【完杀】该技能充分体现了贾诩的冷酷无情。装备后，增加自身攻击力。"
    },
