    surrunderdesc_9: {
        i18n_id: "surrunderdesc_9",
        i18n_cn: "我观察你很久了，你与我一样，是个有理想的人！"
    },
    surrunderdesc_19: {
        i18n_id: "surrunderdesc_19",
        i18n_cn: "主公之城，若由我守，则坚不可摧也！"
    },
    surrunderdesc_29: {
        i18n_id: "surrunderdesc_29",
        i18n_cn: "主公，我虽然是个水兵，但我不只会游泳，我还会灌水！让我来帮您灌水吧！"
    },
    surrunderdesc_39: {
        i18n_id: "surrunderdesc_39",
        i18n_cn: "我这一生，都在执着于跑龙套，直到我遇到了主公你！是你改变了我的命运，我想继续跟你混，你看我拿斧子的样子帅吗？！"
    },
    surrunderdesc_49: {
        i18n_id: "surrunderdesc_49",
        i18n_cn: "长路漫漫伴你闯，我只要你一个人欣赏… … "
    },
    surrunderdesc_59: {
        i18n_id: "surrunderdesc_59",
        i18n_cn: "听闻主公恭谦爱才，今前来投奔，愿为主公效力！"
    },
    surrunderdesc_69: {
        i18n_id: "surrunderdesc_69",
        i18n_cn: "主公，听说你要付双倍薪水挖我？请问现金还是刷卡？各大银行我都方便的！"
    },
    surrunderdesc_79: {
        i18n_id: "surrunderdesc_79",
        i18n_cn: "我的好兄弟孙策去了，我实在看不惯他弟弟孙权那犹豫不决的样子，不知主公是否愿意让我来辅佐您？！"
    },
    surrunderdesc_89: {
        i18n_id: "surrunderdesc_89",
        i18n_cn: "我爹临死前嘱咐我，誓死也要保护你，您以后就是我亲大哥！"
    },
    surrunderdesc_99: {
        i18n_id: "surrunderdesc_99",
        i18n_cn: "主公得我，犹如得东方朔矣！"
    },
    surrunderdesc_109: {
        i18n_id: "surrunderdesc_109",
        i18n_cn: "主公最近人气爆棚，人称江湖新晋男神，在下慕名而来，只为做您背后的一朵绿叶，为您挡风遮雨！我擅长射箭，咻！咻！咻！"
    },
    surrunderdesc_119: {
        i18n_id: "surrunderdesc_119",
        i18n_cn: "听说主公可以让我在家乡和亲人团聚，所以小女子前来投奔！只要您能成全，小女子愿做牛做马！"
    },
    surrunderdesc_129: {
        i18n_id: "surrunderdesc_129",
        i18n_cn: "听闻主公广开言路，善纳谏言，而在下正是主公所需之人！"
    },
    surrunderdesc_139: {
        i18n_id: "surrunderdesc_139",
        i18n_cn: "我是一名巫兵，我是一名文艺兵，我能为您排忧解难，我能为您表演节目，我还能为您治病疗伤。主公您要是收了我，还可以一才多用，多划算呀！"
    },
    surrunderdesc_149: {
        i18n_id: "surrunderdesc_149",
        i18n_cn: "主公，听说你是土豪出身，征兵后给发内裤，我都三年没换过内裤了，这下可好了，妈妈再也不用担心我一身馊味了！"
    },
    surrunderdesc_159: {
        i18n_id: "surrunderdesc_159",
        i18n_cn: "看我这兵种就知道，我这重弩可不是人人都能拿准的！想必主公正缺乏我这样的人才，所以我就来投靠你了！让我帮你射出一片天！"
    },
    surrunderdesc_169: {
        i18n_id: "surrunderdesc_169",
        i18n_cn: "(✿◡‿◡) 你若是真汉子，就收了小生吧… …"
    },
    surrunderdesc_179: {
        i18n_id: "surrunderdesc_179",
        i18n_cn: "主公，你终于肯答应帮我找回失去的记忆了？"
    },
    surrunderdesc_189: {
        i18n_id: "surrunderdesc_189",
        i18n_cn: "主公，听说你能治好我的黑眼圈，我来了，能先给个包子吃么，不要被咬过的……"
    },
    surrunderdesc_199: {
        i18n_id: "surrunderdesc_199",
        i18n_cn: "百步穿杨，莫有不中！主公要的天下，就让我用这把弓来夺取！"
    },
