    "11101602": {
        i18n_id: "11101602",
        i18n_cn: "护驾大使，不管主公有难没难都要在最前面。他杀敌一千自损八百却毫无惧色！更厉害的是，他可以舍弃自己的随身武器，赤手空拳的闯入敌阵！光他的气势就足以抵挡敌人的进攻。他刚正不阿，正气十足，反贼无法操控这样的猛将。却谋虑不足，与玩家几次发生正面冲突，却不知道，玩家才是他的主公——曹操真正需要的人。"
    },
    "11202002": {
        i18n_id: "11202002",
        i18n_cn: "魏开国功臣，是仅次于五子良将的存在，智勇皆有，又具奸雄气质。初为袁绍部将，为其毁家纾难在所不辞。这样一个人，却眼光独到，狠辣无情，在袁绍极为强盛、曹操尚且龙潜之时，便果断带兵投奔曹操。但之后，他依然亲率旧部，曹操担心其拥兵自重，一直有所忌惮，所以后来派于禁夺其兵营。而这并未影响他后来的拜将封侯之路，其死后还祀于曹操庙庭。"
    },
    "16400402": {
        i18n_id: "16400402",
        i18n_cn: "我叫多多，最初是五鹿的小弟，后被满宠收编做了青州兵，因为我力气大，满宠让我拿锤子，想当年我也和张飞睡过上下铺，张飞打呼声尼玛太可怕了。"
    },
    "16403802": {
        i18n_id: "16403802",
        i18n_cn: "我叫王月轮，最初是平汉的副导演，尼玛女演员都不找我，后来朱灵看有我潜力，让我做了青州长戟兵，想当年我也执导过赤壁之战。"
    },
    "12101602": {
        i18n_id: "12101602",
        i18n_cn: "忠肝义胆之士，刘备的神秘后盾。拥有超强回复力的不死之身。诸葛亮一度怀疑其神秘力量的来源，民间疯传他是吸血鬼投胎，他自己解释曾经死过一次，越过地狱之火重回阳间时，就多了自动补血的能力。也正因为这种特殊功能，使他看上去始终带着一种异世界恐怖感，使诸将很难和他和谐搭配。"
    },
    "12201802": {
        i18n_id: "12201802",
        i18n_cn: "哥哥糜竺，原为徐州大商，曾在刘备遭吕布偷袭而粮草不济时，大力资助使其重振，并将其妹嫁与刘备，即糜夫人。长坂兵败后，她为了不拖累赵云而投井自杀，赵云害怕曹军盗尸，推土墙将麋夫人掩埋。罗贯中曾作诗赞其“女丈夫”。"
    },
    "12301702": {
        i18n_id: "12301702",
        i18n_cn: "原为东汉末年益州牧刘璋的部将，后降刘备。在汉中对曹操的战役中，与马超、张飞各领一军，驻扎在下辩，被魏将曹洪所击败，败退时为阴平的氐族首领强端所杀。"
    },
    "13100302": {
        i18n_id: "13100302",
        i18n_cn: "正统的富二代加官二代，理当是众人敬仰的对象。但因为庶出，始终对自己的身份自卑不已。对兄长孙策又妒又爱，希望有一天能超越兄长，证明自己的实力。幸得孙策对他关爱有加，两人守望相助，为东吴基业共同奋斗！孙策遇刺身亡后，他难过不已，同时也激发了他的斗志，一定要统一三国，完成兄长的遗愿！"
    },
    "13201602": {
        i18n_id: "13201602",
        i18n_cn: "少年时便骁勇善战，斩将夺旗，屡立功勋。东兴之战，雪奋短兵，大破魏军。后又辅助孙休诛灭权臣孙綝，被拜为大将。他是吴国的重要将领，计略过人，能断大事，与北方政权从曹操时代打到司马炎时代，历任孙权到孙皓四位吴国君主，见证了三国的盛衰兴亡。但他死后，孙皓为追究他当年出兵无功而返的责任，杀害了他的儿子丁温，流放了他的家属。"
    },
    "13301102": {
        i18n_id: "13301102",
        i18n_cn: "三国时期吴国武将，早年随从孙坚、孙策征伐，又辅助孙权，稳定江东，功勋卓著。"
    },
    "14100302": {
        i18n_id: "14100302",
        i18n_cn: "浮萍飘海，绣茵锦簇，只可惜再漂亮也是无根浮花，随波逐流，沉沦汩没于其间。身为歌女，为国献身作为间谍长期潜伏在董卓身边，后又爱上吕布，为了能保留情郎性命，甘愿受反贼利用，欺骗玩家。最后吕布死，心也碎，为救真爱自己的玩家性命而牺牲，终于摆脱反贼的控制，临终前吟出：星芒日曦，六世徘徊；这似乎解释了她长时间的痛苦，也似乎有着别的含义。"
    },
    "14201602": {
        i18n_id: "14201602",
        i18n_cn: "东汉末年权臣、凉州军阀。本为董卓手下的排名第一的凉州系心腹大将，统领“飞熊军”。曾为董卓游说孙坚和亲结盟，但被拒绝。董卓死后，他挟天子辅政四年、设立雍州。曾破朱儁，败马腾，走孙坚，击西羌。后被曹操讨伐诛杀，灭其三族。他死后，汉献帝命令将他的首级高挂许都示众，以表达对其强烈痛恨。"
    },
    "14301002": {
        i18n_id: "14301002",
        i18n_cn: "黄巾贼将领，黄巾之乱后，聚众占山为王。本欲夺取关羽的赤兔马，在得知对方是关羽后有意归顺，将朋友周仓介绍给关羽。不久后，在赵云路过山前时欲夺其马匹，被赵云斩杀。"
    },
    "16401002": {
        i18n_id: "16401002",
        i18n_cn: "在“人公将军”手下，有一群专门为黄巾兄弟排忧解难、表演节目、治病疗伤的队伍，那就是我们黄巾巫兵了，我们也是专门学习过太平要术的。而我魏成，因为表现良好还是一个小头目呢。"
    },
    "16405802": {
        i18n_id: "16405802",
        i18n_cn: "本来我是一名普普通通的农民，但是因为要打仗，被征集当了长枪兵。当时征兵的问我叫什么，我说姓袁，名王八，征兵的人说这个名字不能用，于是给我改名叫袁力。让我跟着文丑将军。其实文丑将军一点都不丑，真不知道为什么要叫文丑。"
    },
    "16402902": {
        i18n_id: "16402902",
        i18n_cn: "我叫麻花藤，是一名普通的西凉重弩兵。马腾大人当年还夸我射箭射的准呢，其实我想告诉他，我不仅仅射箭准，学习能力也很强呢。"
    },
    "14200802": {
        i18n_id: "14200802",
        i18n_cn: "兵败如山倒，过去的人公将军，瞬间逊为凡人。这个世界对于他，不再会有荣华富贵、金银财宝、荣耀和尊严，过去的目标已被践踏的粉碎，没有翻身的可能，于是只能迁怒于天下人，也许重新从天下人手中重新收集资源，还有翻版的可能。却不知失去民心，比失去生命还可怕，从他手刃平民的那一刻起，就已经输了。"
    },
    "13100402": {
        i18n_id: "13100402",
        i18n_cn: "公瑾身材高大、相貌俊美，志向远大，与孙策自幼交好。他21岁起，随孙策平定江东，孙策遇刺身亡后，孙权继任，他又继续辅佐孙权。他曾率江东集团大军与刘备联合，赤壁之战大败曹军。他性度恢廓，堪称奇才，只怜天妒豪杰，英雄命短，他只活了36岁，便一病而去！"
    },
    "12100802": {
        i18n_id: "12100802",
        i18n_cn: "字子龙，蜀国五虎上将之一，军中人称“虎威将军”。他身长八尺，姿颜雄伟，文武双全，完美无缺。追随刘备后，他两扶幼主，尤其在长坂坡之战七进七出，救出刘禅；他还帮助刘备克定祸乱，刘备曾赞：子龙一身是胆也！"
    },
    "19200302": {
        i18n_id: "19200302",
        i18n_cn: "阿奇这辈子最大的愿望，就是把黑眼圈治好，然后照张彩色照片。（宠物们主要作为战技升级材料，可在战技升级时吃掉，好吃你就多吃点。）"
    },
    "17100802": {
        i18n_id: "17100802",
        i18n_cn: "她的一生见证了整个动荡的三国时代。她出生那年，董大胖儿挟傀儡天子迁都长安，直到钟会西征灭蜀、司马氏颠覆魏政。吴国也在她死后11年，最终玩完了。她为人聪明有才，善于鉴人知事。她是历史的旁观者，但却不是局外人，她一生勤俭节约，最终用自己的才智保全了家人。"
    },
