    "21100302": {
        i18n_id: "21100302",
        i18n_cn: "它与关羽被互相视为象徵，又称关刀。关羽年轻时武艺超群，一直想要一把宝刀，于是请来了最好的铁匠，只在月圆之夜打造它。快完工时，天已黑，一轮皓月当空，突然炉火迸出雪亮的豪光，直射天空，原来刀要炸了。就在这时，天上有一条青龙经过，恰被豪光击中，青龙被斩，从空中滴下1780滴鲜血，染红了刀头，而青龙偃月刀因此得以炼成，但需杀1780人以泄青龙之怒。后来这把刀真的杀了1780人，其中斩首480人。"
    },
    "21200102": {
        i18n_id: "21200102",
        i18n_cn: "寒冰剑，剑身采用千年寒冰铸造，终年不化。夏日必备神器。三国杀拆迁办认证。"
    },
    "21300402": {
        i18n_id: "21300402",
        i18n_cn: "丈八蛇矛之子，虽说不如他爸爸那样厉害，但是其战力已经远超普通的兵器。"
    },
    "22100602": {
        i18n_id: "22100602",
        i18n_cn: "白虎是战伐之神，四大神兽之一，与青龙共为镇邪的神灵，传说它们具有降服鬼物的能力。它象征着威武和军队，因此古代与兵事有关的地方多以白虎冠名，白虎胄即得名于此。后人还将白虎之象刺于甲胄之上，以求在战场中能够“御敌于千里之外，杀敌于无形之中”。"
    },
    "22200602": {
        i18n_id: "22200602",
        i18n_cn: "此面罩在三国时期失踪，后为兰陵王所得，戴上之后战斗力飙升，视敌人为草芥。"
    },
    "23100102": {
        i18n_id: "23100102",
        i18n_cn: "它是一代枭雄曹操的坐骑。其形如名，形容奔跑速度快得连影子都跟不上，瞬间便可无影无踪。宛城之战，它身中三箭竟还能奋蹄疾驰，且速度极快，最后被乱箭射中眼睛才倒了下去。最后曹操在失去长子曹昂、侄子曹安民与虎将典韦的同时，也失去了这匹良驹。"
    },
    "23200102": {
        i18n_id: "23200102",
        i18n_cn: "三国名将魏延的坐骑，同当年西楚霸王项羽的坐骑同名，此种马在项羽时期号称天下第一骏马。著名的大文豪郭沫若先生还专门写了一首七律无题诗来歌颂乌骓马。"
    },
    "23300402": {
        i18n_id: "23300402",
        i18n_cn: "三国名马，奔跑起犹如一道闪电，追也追不上，号称马中闪电侠。"
    },
    "24100402": {
        i18n_id: "24100402",
        i18n_cn: "刘禅做了亡国奴后，有一次，司马昭故意试探他是否还思念蜀国，有无复国之意，他回答道：“此间乐，不思蜀也。”。该典故即源于此，后用于形容蜀后主刘禅甘心为虏，不思复国。然而也正因他如此，刘氏血脉才最终得以保全。"
    },
    "24200302": {
        i18n_id: "24200302",
        i18n_cn: "当年曹操准备攻打江东，苦于士兵坐船不适。庞统为了配合周瑜的火攻，让曹操的行动失败，就建议曹操把所有的战船用铁索连接起来，使其稳定。曹操很高兴，就采纳了这个建议，并把这些船称为“连环战船”。结果这些战船被大火一把烧个精光。后人将此计称为铁索连环。"
    },
    "24400102": {
        i18n_id: "24400102",
        i18n_cn: "公元215年（建安二十年）五月，孙权领着十万大军，吕蒙、蒋钦、潘璋、周泰、陈武、董袭、徐盛等猛将围攻皖城。五更时大军猛攻，辰时破城。四五个小时便强力夺城，结束战斗。一力降十会，占据绝对力量，只需强攻就能击败敌人。"
    },
