    "31100702": {
        i18n_id: "31100702",
        i18n_cn: "【刚烈】获得夏侯惇有仇必报的性格，属卖血技能，主防。受伤后易触发，可立即对敌方单体造成伤害。"
    },
    "31200202": {
        i18n_id: "31200202",
        i18n_cn: "【奇策】荀攸可伤敌亦可疗伤的奇能，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害，或回复己方场上全体一定血量。"
    },
    "31202202": {
        i18n_id: "31202202",
        i18n_cn: "【宣烈】鲍勋以死明谏之烈，属卖血技能，主防。阵亡时，可对敌方单体造成防御伤害。"
    },
    "35101702": {
        i18n_id: "35101702",
        i18n_cn: "【看破】可获得孔明智慧之眼，属被动技能，主智。装备后，可增加自身智力。"
    },
    "32201702": {
        i18n_id: "32201702",
        i18n_cn: "【淑慎】防御最低的敌人最怕看到的就是甘夫人的死，属卖血技能，主防。阵亡时，可对场上防最低敌军造成防御伤害。"
    },
    "33100902": {
        i18n_id: "33100902",
        i18n_cn: "【连营】陆逊能够秒杀敌人的秘计，属攻击技能，主智。行动时易触发，可对敌方单体造成智力伤害，有几率连续多次施放。"
    },
    "33201802": {
        i18n_id: "33201802",
        i18n_cn: "【剑舞】不怕死的绝技，血最多的敌人最怕此技，属卖血技能，主防。阵亡时，可对场上血最多敌军造成防御伤害。"
    },
    "34100702": {
        i18n_id: "34100702",
        i18n_cn: "【无前】吕玲绮仅凭才智便可让敌方全军错乱的能力，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害。"
    },
    "34201802": {
        i18n_id: "34201802",
        i18n_cn: "【符箓】黄金雷使的化身，可助己方血最少战友回血，属控场技能，主智。行动前易触发，可让场上血最少己方武将回复一定血量。"
    },
    "30310602": {
        i18n_id: "30310602",
        i18n_cn: "【破甲】以武力取胜的方法之五，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "30210602": {
        i18n_id: "30210602",
        i18n_cn: "【鹤翼】能使人生命延长的阵法，属被动技能，主血。装备后，可增加自身血量。"
    },
    "35102202": {
        i18n_id: "35102202",
        i18n_cn: "【英姿】美周郎飒爽迷人的不世之姿，属控场技能，主智。行动前易触发，可减少自身下一次受到的伤害，同时增加自身下一次造成的伤害。"
    },
    "10000202": {
        i18n_id: "10000202",
        i18n_cn: "【绝情】春哥能让敌人无法发动技能的绝技，属控场技能，主攻。行动前易触发，可对敌方单体造成攻击伤害，同时将其封印2回合。"
    },
    "34100102": {
        i18n_id: "34100102",
        i18n_cn: "【神愤】地狱邪神吕布的神之怒火，属攻击技能，主攻。装备后，对敌方全体造成伤害，同时增加敌方全体下一次受到的伤害、降低敌方全体下一次造成的伤害，神·吕布自身则由于反噬而失去部分血量。"
    },
