    "31100802": {
        i18n_id: "31100802",
        i18n_cn: "【遗计】郭嘉死前留下的最后一计，能让己方战友活得更久，属卖血技能，主防。受伤后易触发，可减少己方另外2名武将下一次受到的伤害。"
    },
    "35100902": {
        i18n_id: "35100902",
        i18n_cn: "【贤勇】成就关索的金刚不坏之身，属被动技能，主防。装备后，可增加自身防御力。"
    },
    "32100402": {
        i18n_id: "32100402",
        i18n_cn: "【仁德】刘备收买人心的手段，既能增加友军输出，又能回复自身血量，属控场技能，主攻。行动前易触发，可回复自身一定血量，同时让1名己方武将下一次造成的伤害增加。"
    },
    "32101402": {
        i18n_id: "32101402",
        i18n_cn: "【结姻】相传与孙尚香结婚的男性能够延年益寿，属控场技能，主智。行动前易触发，可回复自身和己方1名男性武将一定血量。"
    },
    "35300102": {
        i18n_id: "35300102",
        i18n_cn: "【生阵】能够让生命延长，属被动技能，主血。装备后，可增加自身血量。"
    },
    "35102402": {
        i18n_id: "35102402",
        i18n_cn: "【谦逊】陆逊的防人之心，属被动技能，主防。装备后，可增加自身的防御力。"
    },
    "33201902": {
        i18n_id: "33201902",
        i18n_cn: "【夺刀】潘璋即可伤敌亦可减少被敌所伤的看家本领，属控场技能，主攻。行动前易触发，可增加自身下一次造成的伤害，同时减少敌方单体下一次造成的伤害。"
    },
    "34100802": {
        i18n_id: "34100802",
        i18n_cn: "【蛊惑】于吉乱世动摇人心的秘诀，可伤敌亦可强己，属攻击技能，主智。行动时一般概率触发，可对敌方全体造成智力伤害，或增加己方全体下一次造成的伤害。"
    },
    "34202002": {
        i18n_id: "34202002",
        i18n_cn: "【仗势】能对更多人造成伤害的力量，属攻击技能，主攻。行动时一般概率触发，可对敌方全体造成攻击伤害。"
    },
    "30310702": {
        i18n_id: "30310702",
        i18n_cn: "【回枪】以武力取胜的方法之六，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    "30210702": {
        i18n_id: "30210702",
        i18n_cn: "【冲轭】能使人增加智力的阵法，属被动技能，主智。装备后，可增加自身智力。"
    },
    "33100602": {
        i18n_id: "33100602",
        i18n_cn: "【枭姬】孙尚香的秒敌秘技，属控场技能，主攻。行动前一般概率触发，有几率连续多次增加自身下一次造成的攻击伤害。"
    },
    "32100502": {
        i18n_id: "32100502",
        i18n_cn: "【奇才】旷世之才智让对手无处可逃，属控场技能，主智。行动前易触发，有几率对全体造成多段伤害，并减少自身下一次受到的伤害。"
    },
