    itemdesc311021: {
        i18n_id: "itemdesc311021",
        i18n_cn: "【贞烈】王异与敌人同归于尽的决心，属卖血技能，主防。阵亡时，可对敌方单体造成剧烈防御伤害。"
    },
    itemdesc312021: {
        i18n_id: "itemdesc312021",
        i18n_cn: "【峻刑】满宠的执法之道，能扼制攻击最高的敌人，属控场技能，主智。行动前易触发，可使场上攻最高敌军下一次造成伤害减少。"
    },
    itemdesc321011: {
        i18n_id: "itemdesc321011",
        i18n_cn: "【火计】孔明火烧赤壁之计，随便动动脑，可使敌人全军覆没，属攻击技能，主智。行动时易触发，可对敌方场上全体造成智力伤害。"
    },
    itemdesc322016: {
        i18n_id: "itemdesc322016",
        i18n_cn: "【燕语】能抗锤子的女人，自然一个顶三个，属攻击技能，主攻。行动时一般概率触发，可对敌方场上全体造成攻击伤害。"
    },
    itemdesc331006: {
        i18n_id: "itemdesc331006",
        i18n_cn: "【枭姬】孙尚香的秒敌秘技，属控场技能，主攻。行动前一般概率触发，有几率连续多次增加自身下一次造成的攻击伤害。"
    },
    itemdesc332011: {
        i18n_id: "itemdesc332011",
        i18n_cn: "【虎媚】小虎能够伤人的媚眼绝技，属攻击技能，主智。行动时一般概率触发，可对敌方单体造成智力伤害。"
    },
    itemdesc341003: {
        i18n_id: "itemdesc341003",
        i18n_cn: "【离间】貂蝉能让敌方2名男性自相残杀的媚术，属控场技能，主智。行动前易触发，可对敌方2名男性武将造成智力伤害。"
    },
    itemdesc342007: {
        i18n_id: "itemdesc342007",
        i18n_cn: "【焚城】火烧洛阳之策，能让敌军受到更深的伤害，属攻击技能，主智。行动时一般概率触发，可对敌方场上全体造成智力伤害，同时增加其下一次受到的伤害。"
    },
    itemdesc303101: {
        i18n_id: "itemdesc303101",
        i18n_cn: "【重装】以武力取胜的方法之一，已在士兵中普及，属攻击技能，主攻。行动时较困难触发，可对敌方单体造成攻击伤害。"
    },
    itemdesc302101: {
        i18n_id: "itemdesc302101",
        i18n_cn: "【北斗】能使人增加攻击力的阵法，属被动技能，主攻。装备后，可增加自身攻击力。"
    },
    itemdesc351007: {
        i18n_id: "itemdesc351007",
        i18n_cn: "【伤逝】当春哥忧伤时，将展现出巨大的能量。装备后，可增加自身攻击力。"
    },
