    surrunderdesc_1: {
        i18n_id: "surrunderdesc_1",
        i18n_cn: "今天下英雄，惟君与操耳！"
    },
    surrunderdesc_11: {
        i18n_id: "surrunderdesc_11",
        i18n_cn: "主公久经善战，真乃乱世豪杰！不知是否介意帐下多容一人？"
    },
    surrunderdesc_21: {
        i18n_id: "surrunderdesc_21",
        i18n_cn: "曹操曾夸我有勇有谋，主公，我可以为您打仗，还可以为您管理民政事务！"
    },
    surrunderdesc_31: {
        i18n_id: "surrunderdesc_31",
        i18n_cn: "再也不想过打扫女厕所的日子了，主公，听说你要去打孙权？带上我吧！"
    },
    surrunderdesc_41: {
        i18n_id: "surrunderdesc_41",
        i18n_cn: "有我一夫当关而万夫莫开！"
    },
    surrunderdesc_51: {
        i18n_id: "surrunderdesc_51",
        i18n_cn: "吾身负血海深仇，余生只为灭曹而活！今吾观天下大势，唯主公可成大气，故特来投奔！"
    },
    surrunderdesc_61: {
        i18n_id: "surrunderdesc_61",
        i18n_cn: "主公，听我夫君说要来投靠你，所以我也来了，没想到你竟然长得如此英俊，害我刚刚心里小鹿乱撞了… …"
    },
    surrunderdesc_71: {
        i18n_id: "surrunderdesc_71",
        i18n_cn: "想当年我还曾跟丞相去北伐，现在我已然是一个身经百战的骑兵了，主公，我这次来投奔你，你不会再嫌弃我了吧？！"
    },
    surrunderdesc_81: {
        i18n_id: "surrunderdesc_81",
        i18n_cn: "吾不忍眼见朝廷昏庸，官吏腐败，社会动荡，愿与主公练兵习武，成就大事！"
    },
    surrunderdesc_91: {
        i18n_id: "surrunderdesc_91",
        i18n_cn: "这是我第一次为了一个人，忘了自己… …"
    },
    surrunderdesc_101: {
        i18n_id: "surrunderdesc_101",
        i18n_cn: "听说主公此次来淮南是为了秘密招兵？！您看我有侠义胆气，水性又好，能不能让我当个先锋？"
    },
    surrunderdesc_111: {
        i18n_id: "surrunderdesc_111",
        i18n_cn: "主公，听说你最近老是遭人暗算，我是特意来保护你的！"
    },
    surrunderdesc_121: {
        i18n_id: "surrunderdesc_121",
        i18n_cn: "我就是喜欢主公你这样威武雄壮的强者！"
    },
    surrunderdesc_131: {
        i18n_id: "surrunderdesc_131",
        i18n_cn: "感谢主公的救命之恩，我被主公的正义行为所感动，我愿一心一意为您效劳！"
    },
    surrunderdesc_141: {
        i18n_id: "surrunderdesc_141",
        i18n_cn: "我叫李廉洁，主公，你看我的名字就应该知道我有多厉害了！让我用锤子保护你吧！"
    },
    surrunderdesc_151: {
        i18n_id: "surrunderdesc_151",
        i18n_cn: "我就是战场上的杀人机器，带我上战场，可保主公你收割无忧！"
    },
    surrunderdesc_161: {
        i18n_id: "surrunderdesc_161",
        i18n_cn: "吾常闻主公信义著于四海，今前来投奔，望能与君共创王霸之业！"
    },
    surrunderdesc_171: {
        i18n_id: "surrunderdesc_171",
        i18n_cn: "我再也不敢贪财了，我发誓以后要做一个好人，主公你就收了我吧？！"
    },
    surrunderdesc_181: {
        i18n_id: "surrunderdesc_181",
        i18n_cn: "主公，我就此跟随你当个征服王吧，看起来比较有得享受的样子！"
    },
    surrunderdesc_191: {
        i18n_id: "surrunderdesc_191",
        i18n_cn: "主公，听说你那有鱼吃？给俺肥波波来点……"
    },
